-- Table structure for hs_model
-- ----------------------------
DROP TABLE IF EXISTS `hs_model`;
CREATE TABLE `hs_model` (
  `mid` int(11) NOT NULL AUTO_INCREMENT COMMENT '模型唯一编号',
  `uid` int(11) NOT NULL COMMENT '上传用户编号',
  `title` varchar(60) NOT NULL COMMENT '名称',
  `order_no` int(11) DEFAULT NULL COMMENT '排序',
  `price` float(10,2) DEFAULT NULL COMMENT '价格 ',
  `multi_price` varchar(5000) DEFAULT NULL COMMENT '多种价格',
  `category_id` int(11) NOT NULL COMMENT '所属类目ID',
  `texture` varchar(5000) NOT NULL COMMENT '材质，tid数组序列化',
  `size` varchar(5000) NOT NULL COMMENT '数组序列化',
  `sales` int(11) DEFAULT '0' COMMENT '销量',
  `author` int(11) DEFAULT '40' COMMENT '设计师ID',
  `description` int(11) DEFAULT NULL COMMENT '描述',
  `idea` varchar(1000) DEFAULT NULL COMMENT '设计理念',
  `favorite_num` int(11) DEFAULT '0' COMMENT '商品被收藏数',
  `add_time` datetime DEFAULT NULL COMMENT 'add_time',
  `recommend` int(11) DEFAULT NULL COMMENT '1:推荐到首页 2：不推荐',
  `img` varchar(600) DEFAULT NULL COMMENT '图片路径，数组序列化',
  `model_url` varchar(100) NOT NULL COMMENT '模型文件',
  `status` int(11) DEFAULT NULL COMMENT '1: 审核中 2:展示中 3:已下架 4:暂不出售',
  `searchText` text COMMENT '全文索引',
  `brand` varchar(64) DEFAULT NULL COMMENT '品牌',
  `brand_place` varchar(64) DEFAULT NULL COMMENT '品牌属地',
  `delivery_time` varchar(255) DEFAULT NULL COMMENT '送货时间',
  `customization` int(11) DEFAULT NULL COMMENT '1:可定制 0:不可定制',
  `customization_tip` varchar(255) DEFAULT NULL COMMENT '可定制提示信息',
  `mod_category_parentId` int(11) DEFAULT NULL COMMENT '父类别ID',
  `mod_repertory` int(11) DEFAULT '0' COMMENT '库存',
  `mod_visitcount` int(11) DEFAULT '0' COMMENT '浏览数',
  `mod_shoppingcount` int(11) DEFAULT '0' COMMENT '购物车：当前有多少量在购物车',
  `mod_lastupttime` datetime DEFAULT NULL COMMENT '最后修改时间',
  `mod_tag` varchar(200) DEFAULT NULL COMMENT '商品标签',
  `mod_detail` text COMMENT '商品详情',
  `mod_ddelstate` int(11) DEFAULT NULL COMMENT '商品删除状态：1.正常；2.删除',
  `mod_serve` varchar(200) DEFAULT NULL COMMENT '服务',
  `mod_from` varchar(200) DEFAULT NULL COMMENT '货品产地',
  `mod_element` varchar(200) DEFAULT NULL COMMENT '商品成份',
  `mod_size` varchar(200) DEFAULT NULL COMMENT '商品尺寸',
  `mod_remark` varchar(200) DEFAULT NULL COMMENT '商品备注',
  `mod_weight` varchar(200) DEFAULT NULL COMMENT '商品重量',
  `mod_self_designer` int(11) DEFAULT NULL COMMENT '商品来源：1：美匠 2：设计师',
  PRIMARY KEY (`mid`),
  KEY `uid` (`uid`,`price`,`category_id`),
  KEY `status` (`status`),
  KEY `order_no` (`order_no`)
