-- ----------------------------
-- Table structure for hs_trade
-- ----------------------------
DROP TABLE IF EXISTS `hs_trade`;
CREATE TABLE `hs_trade` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '唯一编号',
  `trade_no` varchar(21) DEFAULT NULL COMMENT '订单号',
  `trade_title` varchar(128) DEFAULT NULL COMMENT '订单名称',
  `uid` int(11) NOT NULL COMMENT '用户编号',
  `total_price` float(10,2) NOT NULL COMMENT '订单总价',
  `trade_detail` varchar(80) DEFAULT NULL COMMENT 'trade_detail ID数组序列化',
  `add_time` datetime NOT NULL COMMENT '下单时间',
  `payment_time` datetime DEFAULT NULL COMMENT '付款时间',
  `wait_supplier_conform_time` datetime DEFAULT NULL COMMENT '通知供货商时间',
  `supplier_conform_time` datetime DEFAULT NULL COMMENT '供货商确认时间',
  `finish_3dprinting_time` datetime DEFAULT NULL COMMENT '打印完成时间',
  `shipments_time` datetime DEFAULT NULL COMMENT '发货时间',
  `finish_time` datetime DEFAULT NULL COMMENT '结束时间',
  `remark` varchar(300) DEFAULT NULL COMMENT '订单备注',
  `phone` char(15) DEFAULT NULL COMMENT '联系电话',
  `realname` varchar(16) DEFAULT NULL COMMENT '真实姓名',
  `address` varchar(200) DEFAULT NULL COMMENT '送货地址',
  `zipcode` int(11) DEFAULT NULL COMMENT '邮政编码',
  `STATUS` int(1) DEFAULT NULL COMMENT '订单状态（1：等待付款 2：已付款，等待发货 3：已发货，等待收货 4：交易完成 5：交易取消 6：供应商打印中）',
  `logistics` varchar(500) DEFAULT NULL COMMENT '物流信息',
  `cancel_info` varchar(100) DEFAULT NULL COMMENT '订单取消原因',
  `alipay_no` char(64) DEFAULT NULL COMMENT '支付宝交易号',
  `alipay_buyer_account` varchar(80) DEFAULT NULL COMMENT '买家支付宝账号',
  `supplier_uid` int(11) DEFAULT NULL COMMENT '供应商uid',
  `wxpay_no` char(32) DEFAULT NULL COMMENT '微信交易号',
  `wx_openid` char(128) DEFAULT NULL COMMENT '微信唯一标志',
  `cash_fee` float(10,2) DEFAULT NULL COMMENT '实际支付',
  `cheap_code` varchar(64) DEFAULT NULL COMMENT '优惠码',
  `cheap_money` float(10,2) DEFAULT '0.00',
  `is_delete` int(1) DEFAULT NULL COMMENT '0正常 1用户删除',
  `postage` float(10,2) NOT NULL DEFAULT '0.00' COMMENT '邮费',
  `is_post` int(1) DEFAULT NULL COMMENT '系统默认/自取0 邮费1',
  `trd_self_designer` int(11) DEFAULT NULL COMMENT '订单来源：1：美匠 2：设计师',
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`),
  KEY `uid_2` (`uid`),
  KEY `trade_no` (`trade_no`),
  KEY `status` (`STATUS`),
  KEY `supplier_uid` (`supplier_uid`)
) ENGINE=MyISAM AUTO_INCREMENT=832 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of hs_trade
-- ----------------------------

