CREATE TABLE `hs_trade_detail` (
  `trade_detail_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '详情唯一编号',
  `id` int(11) NOT NULL COMMENT '模型ID',
  `name` varchar(60) NOT NULL COMMENT '名称',
  `qty` int(11) NOT NULL DEFAULT '1' COMMENT '订购数目',
  `price` float(10,2) NOT NULL COMMENT '单价',
  `remark` varchar(400) DEFAULT NULL COMMENT '备注',
  `options` varchar(300) DEFAULT NULL COMMENT '其他信息',
  `model_type` tinyint(1) DEFAULT '1' COMMENT '1：商品库模型 2：用户上传模型',
  `trade_detail_img` varchar(100) NOT NULL COMMENT 'java trade_detail_img 图片',
  `modelType_id` int(11) DEFAULT NULL COMMENT '商品规则的编号',
  `trade_id` int(11) NOT NULL COMMENT '订单编号',
  PRIMARY KEY (`trade_detail_id`),
  KEY `mid` (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=966 DEFAULT CHARSET=utf8;

