-- ----------------------------
-- Table structure for hs_user
-- ----------------------------
DROP TABLE IF EXISTS `hs_user`;
CREATE TABLE `hs_user` (
  `uid` int(11) NOT NULL AUTO_INCREMENT COMMENT '用户唯一编号',
  `username` varchar(32) DEFAULT NULL COMMENT '用户名',
  `email` varchar(80) DEFAULT NULL COMMENT '电子邮件',
  `phone` char(15) DEFAULT NULL COMMENT '手机号',
  `pwd` char(40) DEFAULT NULL COMMENT '密码',
  `realname` varchar(16) DEFAULT NULL COMMENT '真实姓名',
  `avatar` varchar(500) DEFAULT NULL COMMENT '用户头像路径',
  `sex` int(11) DEFAULT NULL COMMENT '性别',
  `job` varchar(20) DEFAULT NULL COMMENT '职业',
  `d_favorite_num` int(11) DEFAULT NULL COMMENT '设计师被收藏数',
  `province` varchar(30) DEFAULT NULL COMMENT '省份',
  `city` varchar(30) DEFAULT NULL COMMENT '城市',
  `address` varchar(200) DEFAULT NULL COMMENT '送货地址',
  `zipcode` varchar(8) DEFAULT NULL COMMENT '邮政编码',
  `valid_email` varchar(100) DEFAULT NULL COMMENT '电子邮件',
  `reg_time` datetime DEFAULT NULL COMMENT '注册时间',
  `group_id` int(11) DEFAULT NULL COMMENT '用户类型:1：普通用户 2：管理员 3：供应商 4：签约设计师',
  `d_tag` varchar(100) DEFAULT NULL COMMENT '设计师标签',
  `introduce` text COMMENT '个人简介',
  `studio_status` int(11) DEFAULT NULL COMMENT '状态:1:申请中 2：已签约 3：未签约 4：未通过',
  `apply_designer` int(11) DEFAULT NULL COMMENT '状态2:1: 非申请状态 2:申请中',
  `apply_reason` varchar(500) DEFAULT NULL COMMENT '申请理由（品牌故事）',
  `weibo_id` varchar(50) DEFAULT NULL COMMENT '微博ID',
  `qq_openid` varchar(100) DEFAULT NULL COMMENT 'QQ唯一识别码',
  `wx_openid` varchar(100) DEFAULT NULL COMMENT '微信openid',
  `wxp_openid` varchar(100) DEFAULT NULL,
  `wx_unionid` varchar(100) DEFAULT NULL,
  `qq` varchar(20) DEFAULT NULL COMMENT 'QQ号',
  `weixin` varchar(20) DEFAULT NULL COMMENT '微信号',
  `del_state` int(11) DEFAULT NULL COMMENT '状态：1删除；2正常',
  `d_username` varchar(200) DEFAULT NULL COMMENT '设计师名字',
  `d_brand` varchar(200) DEFAULT NULL COMMENT '品牌',
  `d_field` varchar(200) DEFAULT NULL COMMENT '领域',
  `d_address` varchar(200) DEFAULT NULL COMMENT '所在地',
  `designer_time` datetime DEFAULT NULL COMMENT '入住设计师的时间',
  `u_birth_year` varchar(10) DEFAULT NULL COMMENT '用户生日：年',
  `u_birth_moth` varchar(10) DEFAULT NULL COMMENT '用户生日：月',
  `u_birth_day` varchar(10) DEFAULT NULL COMMENT '用户生日：日',
  PRIMARY KEY (`uid`),
  UNIQUE KEY `username` (`username`,`email`,`phone`),
  UNIQUE KEY `weibo_id` (`weibo_id`),
  UNIQUE KEY `qq_openid` (`qq_openid`)
) ENGINE=MyISAM AUTO_INCREMENT=5710 DEFAULT CHARSET=utf8 COMMENT='用户信息表';

