INSERT INTO `hs_model` VALUES ('476', '49', 'YIN 垠 九行星耳钉', null, '1660.00', null, '81', '123', '123', '0', '5264', null, null, '0', '2016-04-02 13:01:48', '2', 'ULAlneLE20160402124411.jpg;jh1EJwN720160402124411.jpg;uPFyWPVy20160402124411.jpg;r1wA9lAj20160402124411.jpg;UfG5yBHw20160402124411.jpg;WxMSnBjA20160402124411.jpg', '123', '2', null, 'YIN隐', '中国', null, null, null, null, '1', '0', '0', '2016-04-05 10:43:45', '耳钉 Yin 九行星', '<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>YIN [垠]</b>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>九行星宝石耳钉</b>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>因 你 而 转 的 黄 金 星 系</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-align:center;\">\r\n	无际的夜空中\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-align:center;\">\r\n	有一颗行星映衬着金色的光辉\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-align:center;\">\r\n	闪耀在你的耳畔\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-align:center;\">\r\n	金色的轨道穿越细腻的耳垂\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-align:center;\">\r\n	天然的宝石守护着包裹双耳小小的宇宙\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-align:center;\">\r\n	温暖而优雅地为你散发光芒\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160402/20160402124514_641.jpg\" alt=\"\" />\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-align:center;\">\r\n	<br />\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>水星 ·&nbsp;紫色 · 紫水晶</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>寂寞造就的旅行家</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	作为全系唯一没有天然卫星的行星，水星成为太阳系最寂寞的所在。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	她以最快的公转速度，如旅行家般执拗地围绕着太阳一圈一圈。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	淹没在耀眼阳光之中难得一见的她，弥漫着沉静且神秘的色彩。孤单属于她，紫色也属于她。\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<br />\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-align:center;\">\r\n	<br />\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>金星 ·&nbsp;黄色 · 黄水晶</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>最闪耀的金色女神</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	她在夜空中比天狼星还要亮14倍，因为这份闪耀，古希腊人将她称为“女神”。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	是的，金星只是一颗不会发光的行星，却如水晶一般缀于夜幕，你无法忽视她那与生俱来的耀眼魅力。\r\n</p>\r\n<div style=\"text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160402/20160402124602_473.jpg\" alt=\"\" />\r\n</div>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-align:center;\">\r\n	<br />\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>地球 ·&nbsp;</b><b>绿色 · 橄榄石</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>满溢生机的平衡母体</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	这颗星球可能承载着整个太阳系最特殊的意义—生命。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	象征生机的绿色用来代表地球再合适不过，\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	但绿色还有另一层含义，<span style=\"line-height:1.5;\">那就是恰如其分的平衡。</span>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	恰好的位置，恰好的速度，恰好的环境，\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	恰好的一切，才得以使其成为孕育生命的母体。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>火星 ·&nbsp;红色 · 石榴石</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>永不停息的探索者</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	古人将火星称为“荧惑”，这束充满着魅惑的红色光芒，\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	吸引着世世代代对她永不停息地探索。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	火星给予人类的，不仅仅是激发无限探求欲的引诱，\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	而是对于未知的遐想与憧憬。她是红色，她是魅惑，她是未知，她是火星。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>木星 ·&nbsp;橙色 · 橙石榴</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>包容万象的皇后</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	木星稳重如皇后般的气场，不仅源于她巨大的质量与体积，\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	更多是因为她的存在，其他行星才得以躲过大多数的天体撞击。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\">\r\n	而她独具韵味的带状大气，<span style=\"line-height:1.5;\">焕发多样光彩的同时，</span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;\">更展现出木星如皇后般能够包容万象的广阔胸襟。</span>\r\n</p>\r\n<div style=\"text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160402/20160402125322_700.jpg\" alt=\"\" />\r\n</div>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-align:center;\">\r\n	<br />\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>土星 ·&nbsp;白色 · 白黄玉</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>光环包裹的隐士</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	太阳系八大行星中，土星传递着克制与自律的涵义，像一位隐士，被绚烂的光环包围着。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	这条独特的行星环，也成为土星最为出众的特征。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	优雅的弧线组成完满的圆，这种完满源自隐忍，而这份独特的美丽，则来自土星。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160402/20160402125422_111.jpg\" alt=\"\" />\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>天王星 ·&nbsp;天</b><b>蓝色 · 托帕石</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>特立独行的吟游诗人</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	近乎横躺在自转轨道上的天王星，一直在用自己特有的方式，走着最为叛逆的道路。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	她不愿受到束缚，她向往着自由，她怀揣着浪漫情怀，希望成为吟游诗人，在太阳系边缘传唱特立独行的诗文。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160402/20160402125444_780.jpg\" alt=\"\" />\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>海王星 ·&nbsp;深蓝色 · 蓝碧玺</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>冷峻优雅的贵族</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	作为一颗冰巨星，海王星寒冷而孤傲。充斥着甲烷的大气，在强大的气压之下，会形成令人无法想象的钻石雨。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	这场雨落于海王星的雨，是如此的高贵，却离我们那么的遥不可及。这种冷冽孤傲的优雅，正是海王星散发的魅力。\r\n</p>\r\n<div style=\"text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160402/20160402125520_458.jpg\" alt=\"\" />\r\n</div>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>冥王星 ·&nbsp;</b><b>黑色 · 黑玛瑙</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>若即若离的局外人</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	沉侵在最黑暗最幽冷的太阳系边缘，距离太阳最远的冥王星，却蕴含着最杂糅的气质。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	她冷漠，但她又执着地围绕着太阳；她若即若离，但她又实实在在属于这里。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	冥王星的复杂，正如混合所有颜色后形成的黑，低调，却绚烂。\r\n</p>\r\n<div style=\"text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160402/20160402125551_181.jpg\" alt=\"\" />\r\n</div>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	若你是创世主，你想在指间创造怎样的星系？\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	让炙热的火星点缀孤傲的海王星\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	让包容的木星陪伴寂寞的水星\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	让叛逆的天王星挑战自律的土星\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	让耀目的金星媲美我们的地球\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	或者，让一直处于边缘的冥王星成为星系的主宰\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	YIN垠以18K纯金，为冰冷的宇宙构筑温暖的轨迹\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	而精心打磨的天然彩色宝石，赋予每一颗行星属于自己的个性\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\">\r\n	但若你为恒星，想拥有怎样的行星家族？\r\n</p>\r\n<div style=\"text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160402/20160402125631_829.jpg\" alt=\"\" />\r\n</div>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	Model/垠 004E\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	Product/ Skinny Gemstone&nbsp;Earrning&nbsp;极简天然宝石耳钉\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	Color/黄金\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	Material/ 18K Gold + Gem 18K金 + 天然宝石\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	Specification/ 宝石边长3mm\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	Inspiration/ The Solar System 宇宙太阳系九大行星\r\n</p>\r\n<div style=\"text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160402/20160402125703_736.jpg\" alt=\"\" />\r\n</div>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	--------------------------------------------------------------------------------\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>关于YIN的包装</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	手工打制的金属玻璃首饰盒\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	含有一丝原始古朴的气质\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	搭配极细黑色缎带\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	令存放首饰也可以成为一种展示\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	&nbsp;\r\n</p>\r\n<div style=\"text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160402/20160402125758_154.jpg\" alt=\"\" />\r\n</div>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160402/20160402125809_425.jpg\" alt=\"\" />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-align:center;\">\r\n	<br />\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>关于YIN</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	造物的过程枯燥冗长。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	打磨器物的同时，\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	更是对人心的考验。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	成为建树深厚的造物者，\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	犹如涅槃成金，\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	须历经乏味、艰辛、困顿甚至苦难。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	没有火炼，就无从证明真金本质。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	凡是曾被用心打造的器物，\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	都是美于形，而精于心，\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	就算它只是一枚小小的金戒……\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	&nbsp;\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>极简</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	单纯简洁是最打动人心的事物。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	不需要过度设计，\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	也不用担心难以驾驭。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	纤细坚强的无限可能性，不言之力。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	Skinny, Delicate, Elegant.\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	YIN的金饰在被戴上的一刻，\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	便已成为身体的一部分。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	&nbsp;\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>暖金</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	金一直被视为珍贵奢侈的象征。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	金的纯粹，\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	以及它为人们带来的愉悦心态，\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	如同落在指间的阳光一般。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	18K不褪色纯度的坚强与真实，\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	YIN是带着温度的暖金。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	&nbsp;\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>手工</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	如果没有严苛到近似残酷的态度，\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	那就不能被称作工艺。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	反复的锻造，打磨，雕琢，\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	手工艺师的价值才能得以体现。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	而YIN真正的魅力在于，\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	在极致细工质量的承诺同时，\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	每件成品却有独一无二的感动细节。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	&nbsp;\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	-----------------------------------------------------------------------------------------\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>YIN设计金饰</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	<b>垠-九行星宝石耳钉</b>\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	现已正式发布，欢迎预订，顺丰包邮。\r\n</p>\r\n<p class=\"p\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;background:#FFFFFF;\">\r\n	*首饰包装盒为手工制作铜架三角玻璃盒，请以实物为准\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '2', '', '中国', '18K金', '水星·紫·紫水晶', '', '暂无明细', '2');
