INSERT INTO `hs_model` VALUES ('481', '73', '枝蔓之源耳钉', null, '499.00', null, '81', '123', '123', '0', '182', null, null, '0', '2016-04-05 20:01:16', '1', 'RkPpjq1220160411171903.jpg;TEzKj7JI20160411171903.jpg;vioDdIE120160411171903.jpg', '123', '2', null, 'Cai jewelry Design', '中国', null, null, null, null, '2', '0', '0', null, '首饰 枝枝蔓蔓 自然 文艺 小清新 仿生 银 14k金 艺术 设计', '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">每一个在城市奔波的人都希望在大自然中得到一刻自由与释放</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">我们总会认为现实与心灵的追求往往不能同时满足</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">其实不然，就好像我将几何的形体比喻为千篇一律的都市生活，将对自由的向往幻化成柔美的有机线条</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">随性随意的枝蔓将死板的几何的形体装饰的生机盎然，带给人不一样的放松感</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">所以，只要用心经营，你的生活也可以如此多姿多彩</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\"><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411171957_41.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411171957_789.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411171958_271.jpg\" alt=\"\" /><br />\r\n</span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\">\r\n	<img width=\"1\" height=\"1\" src=\"file://C:/Users/%E7%BE%8E%E5%8C%A0%E4%B8%80%E5%8F%B7/AppData/Local/Temp/msohtmlclip1/01/clip_image002.jpg\" />\r\n</p>', '1', '', '北京', '银、14K金', '15mm', '', '暂无明细', '2');
