INSERT INTO `hs_model` VALUES ('515', '184', 'Kisses耳线', null, '460.00', null, '81', '123', '123', '0', '5708', null, null, '2', '2016-04-15 11:46:02', '1', 'KEmlKcW820160415114826.jpg;YM4JtscV20160415114827.jpg;Pw8JySfY20160415114832.jpg', '123', '2', null, 'JOY STONE', '北京', null, null, null, null, '5', '0', '0', '2016-04-15 12:24:00', '甜美 可爱 俏皮', '<p style=\"text-align:center;\">\r\n	<span style=\"color:#666666;\">建筑参数建模设计，</span> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"color:#666666;\">整体线条流畅，轮廓年轻俏皮，</span> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"color:#666666;\">跟Kisses巧克力一样甜美可爱。</span><span style=\"color:#666666;\"></span> \r\n</p>\r\n<p>\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160415/20160415114242_729.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160415/20160415114242_483.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160415/20160415114243_149.jpg\" alt=\"\" /> \r\n</p>', '1', '', '北京', '925银 镀金', '均码', '预订周期十个工作日', '无', '2');
INSERT INTO `hs_model` VALUES ('485', '73', 'YIN 莹 珍珠戒指', null, '960.00', null, '78', '123', '123', '0', '5264', null, null, '0', '2016-04-05 21:26:36', '1', 'rVl1NPrH20160413152644.jpg;LkOjbym220160413152644.jpg;jpRXlvFi20160413152644.jpg;37dE7jvg20160413152644.jpg', '123', '2', null, 'YIN隐', '中国', null, null, null, null, '3', '0', '0', null, '戒指 耳钉 Yin', '<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<b><span style=\"color:#938953;font-family:\'Microsoft YaHei\';font-size:18px;font-style:normal;font-weight:bold;background:#FFFFFF;\">YIN设计金饰</span></b><b><span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:18pt;font-style:normal;font-weight:bold;\"><br />\r\n</span></b><b><span style=\"color:#938953;font-family:\'Microsoft YaHei\';font-size:18px;font-style:normal;font-weight:bold;background:#FFFFFF;\">「莹」暖金珍珠系列</span></b> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413152720_466.jpg\" alt=\"\" />\r\n</p>\r\n<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:13.5pt;font-style:normal;\"> \r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">你来自哪里？</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">它们来自大地与海洋。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">深藏沃土，历经挤压拉扯，最终为金；</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">孕于海洋，反复附着沉积，焕化成珠。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">一个棱角鲜明，一个莹润圆满。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">当它们饰于你身体之时，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">即诠释出一方土壤，一片海域。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">你来自母体，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">「莹」则来自大地与海洋。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413152747_450.jpg\" alt=\"\" />\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-size:12px;line-height:1.5;font-family:\'Microsoft YaHei\';\">你是谁？</span>\r\n</p>\r\n</span>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">它们是磨砺和纯粹。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">金需要锤炼，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;line-height:1.5;\">而珍珠却越原始越美好。</span>\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">18K暖金，从原始矿石，被抽丝剥茧般</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">锻造成为简洁的金色线条，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">串联起毫无粉饰的圆白海水珍珠。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">苦其心志的造物过程，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">与浑然天成的自然之美，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">最终会在你的肌肤之上</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">得以真正融汇。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413152826_534.jpg\" alt=\"\" />\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413152843_398.jpg\" alt=\"\" />\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<br />\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">你是美丽的，就像「莹」的美，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">设计，但不过度设计，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">精心锤炼，却纯粹依旧。</span>\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">你是你，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;line-height:1.5;\">它们是你与大地海洋的肌肤之亲。</span>\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">一圈暖金，一颗良珠，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">「莹」是来自大地与海洋的亲吻。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">而你，想要接受这份亲吻吗？</span>\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<br />\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413152907_215.jpg\" alt=\"\" />\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<br />\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<b><span style=\"background:#938953;color:#FFFFFF;font-family:微软雅黑;font-size:13.5pt;font-style:normal;font-weight:bold;\">YIN 「莹」暖金珍珠系列</span></b> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Model/&nbsp;莹</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Inspiration/ 大地 海洋 冰雪 白沙</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Product/暖金珍珠 戒指</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Color&amp; Material /18K黄金 + 天然海水白珍珠</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Specification/戒宽1mm, 珍珠直径4mm</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Size/#8-16 其他尺寸可定制</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413152923_150.jpg\" alt=\"\" />\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">------------------------------------------------------------------------------------</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<b><span style=\"background:#FFFFFF;color:#998300;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:bold;\">关于YIN的包装</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">藏在信封中的低调的戒指</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">小心放入手工打制的金属玻璃首饰盒</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">含有一丝原始古朴的气质</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">搭配极细黑色缎带</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">令存放首饰也可以成为一种展示</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413152939_829.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413152939_971.jpg\" alt=\"\" />\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<br />\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<b><span style=\"background:#FFFFFF;color:#998300;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:bold;\">关于YIN</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">造物的过程枯燥冗长。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">打磨器物的同时，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">更是对人心的考验。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">成为建树深厚的造物者，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">犹如涅槃成金，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">须历经乏味、艰辛、困顿甚至苦难。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">没有火炼，就无从证明真金本质。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">凡是曾被用心打造的器物，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">都是美于形，而精于心，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">就算它只是一枚小小的金戒……</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:9pt;\"> </span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<b><span style=\"background:#FFFFFF;color:#998300;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:bold;\">极简</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">单纯简洁是最打动人心的事物。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">不需要过度设计，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">也不用担心难以驾驭。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">纤细坚强的无限可能性，不言之力。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Skinny, Delicate, Elegant.</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">YIN的金饰在被戴上的一刻，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">便已成为身体的一部分。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:9pt;\"> </span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<b><span style=\"background:#FFFFFF;color:#998300;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:bold;\">暖金</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">金一直被视为珍贵奢侈的象征。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">金的纯粹，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">以及它为人们带来的愉悦心态，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">如同落在指间的阳光一般。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">18K不褪色纯度的坚强与真实，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">YIN是带着温度的暖金。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:9pt;\"> </span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<b><span style=\"background:#FFFFFF;color:#998300;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:bold;\">手工</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">如果没有严苛到近似残酷的态度，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">那就不能被称作工艺。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">反复的锻造，打磨，雕琢，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">手工艺师的价值才能得以体现。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">而YIN真正的魅力在于，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">在极致细工质量的承诺同时，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">每件成品却有独一无二的感动细节。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:9pt;\"> </span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">-----------------------------------------------------------------------------------------</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">［发货说明］</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊所有款式均为定制和手工制作。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊下单付款后开始定制，7-15天内寄出，顺丰包邮。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊首饰包装盒为手工制作玻璃金字塔盒，</span>\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">可能出现手工漆色因运输少有脱落，属正常现象。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">［退换货标准］</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊每一件均为手工精心制作，请注意产品规格，</span>\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">不接受因为自我佩戴观感和主观喜好的退货理由，非质量问题不退货。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊本店使用香港标准尺码，请务必对照周长或直径尺寸选择。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊定制尺寸或刻字请具体沟通。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊如大小不合适可免费更换，往返邮费需客人出。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊如出现质量问题可免费维修，邮费设计师出。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<br />\r\n</p>', '1', '', '中国', '18K金', '8.女1-7号定制、女8-16号定制、女17号及以上定制', '', '暂无明细', '2');
INSERT INTO `hs_model` VALUES ('516', '184', '爆米花项链', null, '499.00', null, '79', '123', '123', '0', '5708', null, null, '1', '2016-04-15 12:08:38', '2', 'RmG5VRyW20160415120608.jpg;8G8UZZEm20160415120608.jpg;Dq62o46220160415120608.jpg', '123', '2', null, 'JOY STONE', '北京', null, null, null, null, '5', '0', '0', null, '甜蜜 趣味性', '<p style=\"text-align:center;\">\r\n	<strong><span style=\"color:#666666;\">说到爆米花，首先想到的就是开心，</span></strong>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<strong><span style=\"color:#666666;\">炸开的时候有噼里啪啦欢乐的声音，外形奔放可爱，</span></strong>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#666666;\"><strong>更重要的每个休闲放松的场合都少不了它。</strong></span>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#666666;\"><strong>爆米花设计的特别之处是在一堆焦糖爆米花里，</strong></span>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#666666;\"><strong>挑选了一颗最可耐的，用硅胶直接翻模，制作而成。</strong></span>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#666666;\"><strong><img src=\"/upload/uploadImg/modeldetail/image/20160415/20160415120447_150.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160415/20160415120447_934.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160415/20160415120447_904.jpg\" alt=\"\" /><br />\r\n</strong></span>\r\n</p>', '1', '', '北京', '925银镀金', '均码', '', '无', '2');
INSERT INTO `hs_model` VALUES ('517', '184', '开心果项链', null, '499.00', null, '79', '123', '123', '0', '5708', null, null, '0', '2016-04-15 12:22:28', '2', 'NrvI5rLQ20160415123844.jpg;;', '123', '2', null, 'JOY STONE', '北京', null, null, null, null, '6', '0', '0', null, '愉悦 趣味性 ', '<p style=\"text-align:center;\">\r\n	<strong><span style=\"color:#666666;\">开心果：听名字就是能代表开心愉悦的心情，</span></strong> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<strong><span style=\"color:#666666;\">做了两款设计，</span></strong> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<strong><span style=\"color:#666666;\">一款是有果仁的，一款是没有果仁的，</span></strong> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<strong><span style=\"color:#666666;\">这款设计也是用的实物，硅胶翻模的技艺，设计而成。</span></strong> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<strong><span style=\"color:#666666;\"><img src=\"/upload/uploadImg/modeldetail/image/20160415/20160415122028_298.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160415/20160415122029_358.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160415/20160415122030_233.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160415/20160415122032_571.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160415/20160415122033_238.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160415/20160415122034_278.jpg\" alt=\"\" /><br />\r\n</span></strong> \r\n</p>', '2', '', '北京', '925银镀金', '均码', '', '无', '2');
INSERT INTO `hs_model` VALUES ('486', '73', 'YIN 莹 珍珠手链', null, '1260.00', null, '80', '123', '123', '0', '5264', null, null, '0', '2016-04-05 21:40:19', '1', 'Zozvajq720160413152153.jpg;bY2Tsa9020160413152153.jpg;kjK1eOOy20160413152153.jpg', '123', '2', null, 'YIN隐', '中国', null, null, null, null, '2', '0', '0', null, '手链 Yin', '<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<b><span style=\"color:#938953;font-family:\'Microsoft YaHei\';font-size:18px;font-style:normal;font-weight:bold;background:#FFFFFF;\">&nbsp; YIN设计金饰</span></b><b><span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:12pt;font-style:normal;font-weight:bold;\"><br />\r\n</span></b><b><span style=\"color:#938953;font-family:\'Microsoft YaHei\';font-size:18px;font-style:normal;font-weight:bold;background:#FFFFFF;\">「莹」暖金珍珠系列</span></b> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">你来自哪里？</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">它们来自大地与海洋。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">深藏沃土，历经挤压拉扯，最终为金；</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">孕于海洋，反复附着沉积，焕化成珠。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">一个棱角鲜明，一个莹润圆满。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">当它们饰于你身体之时，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">即诠释出一方土壤，一片海域。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">你来自母体，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">「莹」则来自大地与海洋。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\"><img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413152254_824.jpg\" alt=\"\" /><br />\r\n</span>\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<br />\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;line-height:1.5;\">你是谁？</span>\r\n</p>\r\n<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:10.5pt;font-style:normal;font-weight:normal;\">\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">它们是磨砺和纯粹。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">金需要锤炼，</span><span style=\"font-size:12px;line-height:1.5;color:#333333;font-family:\'Microsoft YaHei\';\">而珍珠却越原始越美好。</span>\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">18K暖金，从原始矿石，被抽丝剥茧般</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">锻造成为简洁的金色线条，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">串联起毫无粉饰的圆白海水珍珠。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">苦其心志的造物过程，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">与浑然天成的自然之美，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">最终会在你的肌肤之上</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">得以真正融汇。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413152356_521.jpg\" alt=\"\" />\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413152455_926.jpg\" alt=\"\" />\r\n</p>\r\n</span> \r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">你是美丽的，就像「莹」的美，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">设计，但不过度设计，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;line-height:1.5;\">精心锤炼，却纯粹依旧。</span>\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">你是你，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;line-height:1.5;\">它们是你与大地海洋的肌肤之亲。</span>\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">一圈暖金，一颗良珠，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">「莹」是来自大地与海洋的亲吻。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">而你，想要接受这份亲吻吗？</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<img alt=\"\" src=\"/upload/uploadImg/modeldetail/image/20160405/20160405213808_63.jpg\" />\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<b><span style=\"background:#938953;color:#FFFFFF;font-family:微软雅黑;font-size:13.5pt;font-style:normal;font-weight:bold;\">YIN 「莹」暖金珍珠系列</span></b> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Model/&nbsp;莹</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Inspiration/ 大地 海洋 冰雪 白沙</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Product/暖金珍珠手链</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Color&amp; Material /18K黄金 + 天然海水白珍珠</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Specification/珍珠直径4mm</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Size/15cm, 17cm</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">------------------------------------------------------------------------------------</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<b><span style=\"background:#FFFFFF;color:#998300;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:bold;\">关于YIN的包装</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">藏在信封中的低调的戒指</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">小心放入手工打制的金属玻璃首饰盒</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">含有一丝原始古朴的气质</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">搭配极细黑色缎带</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">令存放首饰也可以成为一种展示</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<br />\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413152525_316.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413152525_408.jpg\" alt=\"\" />\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<b><span style=\"background:#FFFFFF;color:#998300;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:bold;\">关于YIN</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">造物的过程枯燥冗长。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">打磨器物的同时，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">更是对人心的考验。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">成为建树深厚的造物者，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">犹如涅槃成金，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">须历经乏味、艰辛、困顿甚至苦难。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">没有火炼，就无从证明真金本质。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">凡是曾被用心打造的器物，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">都是美于形，而精于心，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">就算它只是一枚小小的金戒……</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:9pt;\"> </span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<b><span style=\"background:#FFFFFF;color:#998300;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:bold;\">极简</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">单纯简洁是最打动人心的事物。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">不需要过度设计，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">也不用担心难以驾驭。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">纤细坚强的无限可能性，不言之力。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Skinny, Delicate, Elegant.</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">YIN的金饰在被戴上的一刻，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">便已成为身体的一部分。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:9pt;\"> </span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<b><span style=\"background:#FFFFFF;color:#998300;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:bold;\">暖金</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">金一直被视为珍贵奢侈的象征。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">金的纯粹，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">以及它为人们带来的愉悦心态，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">如同落在指间的阳光一般。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">18K不褪色纯度的坚强与真实，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">YIN是带着温度的暖金。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:9pt;\"> </span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<b><span style=\"background:#FFFFFF;color:#998300;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:bold;\">手工</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">如果没有严苛到近似残酷的态度，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">那就不能被称作工艺。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">反复的锻造，打磨，雕琢，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">手工艺师的价值才能得以体现。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">而YIN真正的魅力在于，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">在极致细工质量的承诺同时，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">每件成品却有独一无二的感动细节。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:9pt;\"> </span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">-----------------------------------------------------------------------------------------</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">［发货说明］</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊所有款式均为定制和手工制作。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊下单付款后开始定制，7-15天内寄出，顺丰包邮。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊首饰包装盒为手工制作玻璃金字塔盒，</span>\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">可能出现手工漆色因运输少有脱落，属正常现象。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">［退换货标准］</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊每一件均为手工精心制作，请注意产品规格，</span>\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">不接受因为自我佩戴观感和主观喜好的退货理由，非质量问题不退货。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊本店使用香港标准尺码，请务必对照周长或直径尺寸选择。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊定制尺寸或刻字请具体沟通。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊如大小不合适可免费更换，往返邮费需客人出。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊如出现质量问题可免费维修，邮费设计师出。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<br />\r\n</p>', '1', '', '中国', '18K金', '15cm、17cm ', '', '暂无明细', '2');
INSERT INTO `hs_model` VALUES ('518', '184', '开心果项链', null, '499.00', null, '79', '123', '123', '0', '5708', null, null, '0', '2016-04-15 12:44:23', '2', 'vFPrQgS020160415123946.jpg;;1dy3reGu20160415124239.jpg;x9mlMrHv20160415124239.jpg', '123', '2', null, 'JOY STONE', '北京', null, null, null, null, '6', '0', '0', null, '甜蜜 趣味性', '<p style=\"text-align:center;\">\r\n	<strong><span style=\"color:#666666;\">开心果：听名字就是能代表开心愉悦的心情，</span></strong>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<strong><span style=\"color:#666666;\">做了两款设计，一款是有果仁的，一款是没有果仁的，</span></strong>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<strong><span style=\"color:#666666;\">这款设计也是用的实物，硅胶翻模的技艺，设计而成。</span></strong>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<strong><span style=\"color:#666666;\"><br />\r\n</span></strong>\r\n</p>', '2', null, '北京', '925银镀金', '均码', '', '无', '2');
INSERT INTO `hs_model` VALUES ('519', '184', '开心果项链', null, '499.00', null, '79', '123', '123', '0', '5708', null, null, '1', '2016-04-15 12:47:20', '2', 'dfjlQq1z20160415124632.jpg;6Ko5F2Z920160415124632.jpg;tR0SDWP120160415124632.jpg', '123', '2', null, 'JOY STONE', '北京', null, null, null, null, '6', '0', '0', null, '甜蜜 趣味性', '<p style=\"text-align:center;\">\r\n	<strong><span style=\"color:#666666;\">开心果：听名字就是能代表开心愉悦的心情，</span></strong>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<strong><span style=\"color:#666666;\">做了两款设计，一款是有果仁的，一款是没有果仁的，</span></strong>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<strong><span style=\"color:#666666;\">这款设计也是用的实物，硅胶翻模的技艺，设计而成。</span></strong>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<strong><span style=\"color:#666666;\"><img src=\"/upload/uploadImg/modeldetail/image/20160415/20160415124710_639.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160415/20160415124711_229.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160415/20160415124712_733.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160415/20160415124712_403.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160415/20160415124713_333.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160415/20160415124715_670.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160415/20160415124715_48.jpg\" alt=\"\" /><br />\r\n</span></strong>\r\n</p>', '1', '', '北京', '925银镀金', '均码', '', '无', '2');
INSERT INTO `hs_model` VALUES ('487', '73', 'YIN 莹 珍珠手镯', null, '5660.00', null, '80', '123', '123', '0', '5264', null, null, '0', '2016-04-05 21:46:44', '1', '1sXkfzSD20160413152119.jpg;gM9VyKeI20160413152119.jpg;CCiZZArZ20160413152119.jpg;Gj9TsBYw20160413152119.jpg', '123', '2', null, 'YIN隐', '中国', null, null, null, null, '2', '0', '0', null, '手镯 珍珠 Yin', '<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<b><span style=\"color:#938953;font-family:\'Microsoft YaHei\';font-size:18px;font-style:normal;font-weight:bold;background:#FFFFFF;\"> YIN设计金饰</span></b><b><span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:12pt;font-style:normal;font-weight:bold;\"><br />\r\n</span></b><b><span style=\"color:#938953;font-family:\'Microsoft YaHei\';font-size:18px;font-style:normal;font-weight:bold;background:#FFFFFF;\">「莹」暖金珍珠系列</span></b> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413151541_411.jpg\" alt=\"\" /> \r\n</p>\r\n<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:13.5pt;font-style:normal;\"> \r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;line-height:1.5;background:#FFFFFF;\">你来自哪里？</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;line-height:1.5;background:#FFFFFF;\">它们来自大地与海洋。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;line-height:1.5;background:#FFFFFF;\">深藏沃土，历经挤压拉扯，最终为金；</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;line-height:1.5;background:#FFFFFF;\">孕于海洋，反复附着沉积，焕化成珠。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;line-height:1.5;background:#FFFFFF;\">一个棱角鲜明，一个莹润圆满。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;line-height:1.5;background:#FFFFFF;\">当它们饰于你身体之时，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;line-height:1.5;background:#FFFFFF;\">即诠释出一方土壤，一片海域。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;line-height:1.5;background:#FFFFFF;\">你来自母体，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;line-height:1.5;background:#FFFFFF;\">「莹」则来自大地与海洋。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413151617_37.jpg\" alt=\"\" /> \r\n</p>\r\n</span> \r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">你是谁？</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">它们是磨砺和纯粹。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">金需要锤炼，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;line-height:1.5;\">而珍珠却越原始越美好。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">18K暖金，从原始矿石，被抽丝剥茧般</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">锻造成为简洁的金色线条，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">串联起毫无粉饰的圆白海水珍珠。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">苦其心志的造物过程，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">与浑然天成的自然之美，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">最终会在你的肌肤之上</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">得以真正融汇。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\"><img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413151717_219.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<br />\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">你是美丽的，就像「莹」的美，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">设计，但不过度设计，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">精心锤炼，却纯粹依旧。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">你是你，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">它们是你与大地海洋的肌肤之亲。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">一圈暖金，一颗良珠，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">「莹」是来自大地与海洋的亲吻。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">而你，想要接受这份亲吻吗？</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413151800_622.jpg\" alt=\"\" /> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413151921_530.jpg\" alt=\"\" /> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<br />\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<b><span style=\"background:#938953;color:#FFFFFF;font-family:微软雅黑;font-size:13.5pt;font-style:normal;font-weight:bold;\">YIN 「莹」暖金珍珠系列</span></b> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Model/&nbsp;莹</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Inspiration/ 大地 海洋 冰雪 白沙</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Product/暖金珍珠手镯</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Color&amp; Material /18K黄金 + 天然海水白珍珠</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Specification/珍珠直径4mm</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Size/16cm, 18cm，开口1.5cm</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413151932_860.jpg\" alt=\"\" /> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413152048_631.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413152048_418.jpg\" alt=\"\" />\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<b><span style=\"background:#FFFFFF;color:#998300;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:bold;\">关于YIN</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">造物的过程枯燥冗长。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">打磨器物的同时，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">更是对人心的考验。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">成为建树深厚的造物者，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">犹如涅槃成金，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">须历经乏味、艰辛、困顿甚至苦难。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">没有火炼，就无从证明真金本质。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">凡是曾被用心打造的器物，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">都是美于形，而精于心，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">就算它只是一枚小小的金戒……</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:9pt;\"> </span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<b><span style=\"background:#FFFFFF;color:#998300;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:bold;\">极简</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">单纯简洁是最打动人心的事物。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">不需要过度设计，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">也不用担心难以驾驭。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">纤细坚强的无限可能性，不言之力。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Skinny, Delicate, Elegant.</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">YIN的金饰在被戴上的一刻，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">便已成为身体的一部分。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:9pt;\"> </span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<b><span style=\"background:#FFFFFF;color:#998300;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:bold;\">暖金</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">金一直被视为珍贵奢侈的象征。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">金的纯粹，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">以及它为人们带来的愉悦心态，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">如同落在指间的阳光一般。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">18K不褪色纯度的坚强与真实，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">YIN是带着温度的暖金。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:9pt;\"> </span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<b><span style=\"background:#FFFFFF;color:#998300;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:bold;\">手工</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">如果没有严苛到近似残酷的态度，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">那就不能被称作工艺。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">反复的锻造，打磨，雕琢，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">手工艺师的价值才能得以体现。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">而YIN真正的魅力在于，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">在极致细工质量的承诺同时，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">每件成品却有独一无二的感动细节。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:9pt;\"> </span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">-----------------------------------------------------------------------------------------</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<b><span style=\"color:#333333;font-family:微软雅黑;font-size:12px;font-style:normal;font-weight:bold;background:#FFFFFF;\">YIN设计金饰</span></b><b><span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:bold;\"><br />\r\n</span></b><b><span style=\"color:#333333;font-family:微软雅黑;font-size:12px;font-style:normal;font-weight:bold;background:#FFFFFF;\">「莹」暖金珍珠系列</span></b> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">［发货说明］</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊所有款式均为定制和手工制作。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊下单付款后开始定制，7-15天内寄出，顺丰包邮。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊首饰包装盒为手工制作玻璃金字塔盒，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">可能出现手工漆色因运输少有脱落，属正常现象。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">［退换货标准］</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊每一件均为手工精心制作，请注意产品规格，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">不接受因为自我佩戴观感和主观喜好的退货理由，非质量问题不退货。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊本店使用香港标准尺码，请务必对照周长或直径尺寸选择。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊定制尺寸或刻字请具体沟通。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊如大小不合适可免费更换，往返邮费需客人出。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊如出现质量问题可免费维修，邮费设计师出。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<br />\r\n</p>', '1', '', '中国', '18K金', '16cm/18cm', '', '暂无明细', '2');
INSERT INTO `hs_model` VALUES ('488', '73', 'YIN 莹 珍珠项链', null, '2260.00', null, '79', '123', '123', '0', '5264', null, null, '0', '2016-04-05 21:56:37', '1', 'hdeZsoo020160413150702.jpg;azvrGR7M20160413150702.jpg;RDbIFuix20160413150702.jpg;kAPBcM7O20160413150702.jpg', '123', '2', null, 'YIN隐', '中国', null, null, null, null, '2', '0', '0', null, '项链 珍珠 Yin', '<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#666666;font-family:\'Microsoft YaHei\';font-size:18px;font-style:normal;background:#FFFFFF;\"><strong>YIN设计金饰</strong></span><span style=\"color:#938953;font-family:微软雅黑;font-size:12pt;font-style:normal;background:#FFFFFF;\"><br />\r\n</span><span style=\"color:#666666;font-family:\'Microsoft YaHei\';font-size:18px;font-style:normal;background:#FFFFFF;\"><strong>「莹」暖金珍珠系列</strong></span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413150813_96.jpg\" alt=\"\" />\r\n</p>\r\n<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:13.5pt;font-style:normal;\"> \r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">你来自哪里？</span>\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-size:12px;line-height:1.5;font-family:\'Microsoft YaHei\';\">它们来自大地与海洋。</span>\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">深藏沃土，历经挤压拉扯，最终为金；</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">孕于海洋，反复附着沉积，焕化成珠。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">一个棱角鲜明，一个莹润圆满。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">当它们饰于你身体之时，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">即诠释出一方土壤，一片海域。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">你来自母体，</span>\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-size:12px;line-height:1.5;font-family:\'Microsoft YaHei\';\">「莹」则来自大地与海洋。</span>\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-size:12px;line-height:1.5;font-family:\'Microsoft YaHei\';\"><img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413150919_921.jpg\" alt=\"\" /><br />\r\n</span>\r\n</p>\r\n</span> \r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">你是谁？</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">它们是磨砺和纯粹。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">金需要锤炼，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">而珍珠却越原始越美好。</span>\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">18K暖金，从原始矿石，被抽丝剥茧般</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">锻造成为简洁的金色线条，</span> \r\n</p>\r\n<p align=\"center\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">串联起毫无粉饰的圆白海水珍珠。</span> \r\n</p>\r\n<p align=\"center\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413150952_644.jpg\" alt=\"\" />\r\n</p>\r\n<p align=\"center\">\r\n	<br />\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">苦其心志的造物过程，</span>\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">与浑然天成的自然之美，</span>\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">最终会在你的肌肤之上</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">得以真正融汇。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">你是美丽的，就像「莹」的美，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">设计，但不过度设计，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">精心锤炼，却纯粹依旧。</span>\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413151042_286.jpg\" alt=\"\" />\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<br />\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">你是你，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">它们是你与大地海洋的肌肤之亲。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">一圈暖金，一颗良珠，</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">「莹」是来自大地与海洋的亲吻。</span> \r\n</p>\r\n<p align=\"center\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">而你，想要接受这份亲吻吗？</span> \r\n</p>\r\n<p align=\"center\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413151116_551.jpg\" alt=\"\" />\r\n</p>\r\n<p align=\"center\">\r\n	<br />\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<b><span style=\"background:#938953;color:#FFFFFF;font-family:微软雅黑;font-size:13.5pt;font-style:normal;font-weight:bold;\">YIN 「莹」暖金珍珠系列</span></b> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Model/&nbsp;莹</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Inspiration/ 大地 海洋 冰雪 白沙</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Product/暖金珍珠项链</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Color&amp; Material /18K黄金 + 天然海水白珍珠</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Specification/珍珠直径4mm</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"background:#FFFFFF;color:#938953;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Size/40cm, 42cm</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:9pt;\"> </span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">------------------------------------------------------------------------------------</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:bold;background:#FFFFFF;\"><b><span style=\"color:#998300;font-family:微软雅黑;font-size:9pt;background:#FFFFFF;\">关于YIN的包装</span></b></span></b>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">藏在信封中的低调的戒指</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">小心放入手工打制的金属玻璃首饰盒</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">含有一丝原始古朴的气质</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">搭配极细黑色缎带</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">令存放首饰也可以成为一种展示</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413151223_915.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160413/20160413151223_945.jpg\" alt=\"\" />\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<b><span style=\"background:#FFFFFF;color:#998300;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:bold;\">关于YIN</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">造物的过程枯燥冗长。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">打磨器物的同时，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">更是对人心的考验。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">成为建树深厚的造物者，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">犹如涅槃成金，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">须历经乏味、艰辛、困顿甚至苦难。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">没有火炼，就无从证明真金本质。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">凡是曾被用心打造的器物，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">都是美于形，而精于心，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">就算它只是一枚小小的金戒……</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:9pt;\"> </span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<b><span style=\"background:#FFFFFF;color:#998300;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:bold;\">极简</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">单纯简洁是最打动人心的事物。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">不需要过度设计，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">也不用担心难以驾驭。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">纤细坚强的无限可能性，不言之力。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">Skinny, Delicate, Elegant.</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">YIN的金饰在被戴上的一刻，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">便已成为身体的一部分。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:9pt;\"> </span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<b><span style=\"background:#FFFFFF;color:#998300;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:bold;\">暖金</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">金一直被视为珍贵奢侈的象征。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">金的纯粹，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">以及它为人们带来的愉悦心态，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">如同落在指间的阳光一般。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">18K不褪色纯度的坚强与真实，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">YIN是带着温度的暖金。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:9pt;\"> </span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<b><span style=\"background:#FFFFFF;color:#998300;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:bold;\">手工</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">如果没有严苛到近似残酷的态度，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">那就不能被称作工艺。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">反复的锻造，打磨，雕琢，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">手工艺师的价值才能得以体现。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">而YIN真正的魅力在于，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">在极致细工质量的承诺同时，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">每件成品却有独一无二的感动细节。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:微软雅黑;font-size:9pt;\"> </span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"background:#FFFFFF;color:#333333;font-family:微软雅黑;font-size:9pt;font-style:normal;font-weight:normal;\">-----------------------------------------------------------------------------------------</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">［发货说明］</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊所有款式均为定制和手工制作。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊下单付款后开始定制，7-15天内寄出，顺丰包邮。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊首饰包装盒为手工制作玻璃金字塔盒，</span>\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">可能出现手工漆色因运输少有脱落，属正常现象。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">［退换货标准］</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊每一件均为手工精心制作，请注意产品规格，</span>\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">不接受因为自我佩戴观感和主观喜好的退货理由，非质量问题不退货。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊本店使用香港标准尺码，请务必对照周长或直径尺寸选择。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊定制尺寸或刻字请具体沟通。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊如大小不合适可免费更换，往返邮费需客人出。</span> \r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;font-style:normal;font-weight:normal;background:#FFFFFF;\">＊如出现质量问题可免费维修，邮费设计师出。</span>\r\n</p>\r\n<p align=\"center\" style=\"background:#FFFFFF;text-align:center;text-indent:0pt;\">\r\n	<br />\r\n</p>', '1', '', '中国', '18K金', '40cm  42cm', '', '暂无明细', '2');
INSERT INTO `hs_model` VALUES ('489', '73', '娥眉月项链', null, '4200.00', null, '79', '123', '123', '1', '5267', null, null, '0', '2016-04-06 11:47:01', '1', 'TTZrK8cm20160411154800.jpg;8S27D2hQ20160411154801.jpg;OGrMz4Kd20160411154801.jpg', '123', '2', null, 'Megan Xu', '中国', null, null, null, null, '2', '0', '0', null, '有思想的艺术珠宝 细腻 18k金 白玉 奢侈品', '<div style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-size:14px;font-family:\'Microsoft YaHei\';\">他们看见你皎洁的笑颜不见你心头凝积的霜雪。</span> \r\n</div>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-size:14px;font-family:\'Microsoft YaHei\';\">每个人都像夜空中的月，数十月相构成完整潮汐。</span>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-size:14px;font-family:\'Microsoft YaHei\';\">一面遍洒幽白另一面默如金铁。</span>\r\n</p>\r\n<div style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-size:14px;font-family:\'Microsoft YaHei\';\">双面都是你。</span> \r\n</div>\r\n<div style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-size:14px;font-family:\'Microsoft YaHei\';\">没有好与坏，没有对与错，没有真与假。</span> \r\n</div>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-size:14px;font-family:\'Microsoft YaHei\';\">这样沉默的，顽劣的，单纯的，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:14px;line-height:1.5;\">细腻的你才是黑夜中最美的娥眉月。</span>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:14px;line-height:1.5;\"><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411154846_502.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411154851_936.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411154851_276.jpg\" alt=\"\" /><br />\r\n</span>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<br />\r\n</p>', '1', '作品以翡翠钻石等宝玉石和贵金属为载体阐释万物，是高品质的艺术品和富内涵的奢侈品。', '中国', '18k黄金/白玉', '暂无明细', '', '暂无明细', '2');
INSERT INTO `hs_model` VALUES ('490', '73', '阖圆耳饰', null, '3960.00', null, '81', '123', '123', '0', '5267', null, null, '0', '2016-04-06 11:56:00', '1', 'HgAvEFe620160411154549.jpg;6lV9sGbd20160411154549.jpg;0DPGFXSQ20160411154549.jpg;TKOexbdn20160411154549.jpg;Lkprd8f220160411154549.jpg', '123', '2', null, 'Megan Xu', '中国', null, null, null, null, '3', '0', '0', null, '有思想的艺术珠宝 18k金 钻石 奢侈品', '<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-size:14px;font-family:\'Microsoft YaHei\';\">世间万物生长消亡有时有序，</span>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-size:14px;font-family:\'Microsoft YaHei\';\">在人与人之间的连接中时间很重要。</span>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-size:14px;font-family:\'Microsoft YaHei\';\">一人想停留时另一人要起飞，</span>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-size:14px;font-family:\'Microsoft YaHei\';\">瞬息交错就变成两条平行线。 </span>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-size:14px;font-family:\'Microsoft YaHei\';\">我们这辈子遇见太多人，</span>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-size:14px;font-family:\'Microsoft YaHei\';\">与太多人擦肩/目光交汇/甚至并肩前行一段，</span>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-size:14px;font-family:\'Microsoft YaHei\';\">种种内因外因，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:14px;line-height:1.5;\">多数相遇成了一现的昙花。</span>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-size:14px;font-family:\'Microsoft YaHei\';\">时光流转，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:14px;line-height:1.5;\">最终有人与你拼成一个完整的圆。</span>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-size:14px;font-family:\'Microsoft YaHei\';\"><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411154710_693.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411154716_317.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411154716_663.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411154717_487.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411154717_458.jpg\" alt=\"\" /><br />\r\n</span>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-size:14px;font-family:\'Microsoft YaHei\';\"><br />\r\n</span>\r\n</p>', '1', '作品以翡翠钻石等宝玉石和贵金属为载体阐释万物，是高品质的艺术品和富内涵的奢侈品。', '中国', '18k黄金/钻石', '暂无明细', '', '暂无明细', '2');
INSERT INTO `hs_model` VALUES ('491', '73', '云行手镯', null, '18000.00', null, '80', '123', '123', '0', '5267', null, null, '0', '2016-04-06 14:12:05', '1', 'tSutv5Wy20160411154328.jpg;xmgHz0gA20160411154328.jpg;1mbwP2EC20160411154329.jpg;fjClGRkX20160411154329.jpg;BYeiKp9J20160411154329.jpg', '123', '2', null, 'Megan Xu', '中国', null, null, null, null, '3', '0', '0', null, '有思想的艺术珠宝 奢侈品 18k金 钻石', '<p class=\"MsoNormal\" align=\"left\" style=\"text-align:center;background-color:white;\">\r\n	<span style=\"font-size:14px;font-family:\'Microsoft YaHei\';color:#333333;\">纵横轴坐标构成整个人生。</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"text-align:center;background-color:white;\">\r\n	<span style=\"font-size:14px;font-family:\'Microsoft YaHei\';color:#333333;\">时间是无尽海洋，可载舟可覆舟，一切在你手中，航向自己决定 。</span><span style=\"font-size:14px;font-family:\'Microsoft YaHei\';color:#333333;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"text-align:center;background-color:white;\">\r\n	<span style=\"font-size:14px;font-family:\'Microsoft YaHei\';color:#333333;\"><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411154424_640.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411154431_815.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411154432_678.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411154432_898.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411154433_982.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411154433_106.jpg\" alt=\"\" /><br />\r\n</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"text-align:center;background-color:white;\">\r\n	<span style=\"font-size:14px;font-family:\'Microsoft YaHei\';color:#333333;\"><br />\r\n</span> \r\n</p>', '1', '作品以翡翠钻石等宝玉石和贵金属为载体阐释万物，是高品质的艺术品和富内涵的奢侈品。', '中国', '18k黄金/钻石', '暂无明细', '', '暂无明细', '2');
INSERT INTO `hs_model` VALUES ('492', '73', 'YIN 垠 九行星耳钉', null, '1660.00', null, '81', '123', '123', '0', '5264', null, null, '0', '2016-04-06 15:48:59', '2', 'vP52jCbS20160412173350.jpg;0cflhXi620160412173350.jpg;kgIg7bi620160412173350.jpg;lnWYr34o20160412173350.jpg;jEALY68g20160412173350.jpg', '123', '2', null, 'YIN隐', '中国', null, null, null, null, '9', '0', '0', '2016-04-06 15:53:11', '耳钉 Yin 九行星', '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:18px;line-height:1.5;\">YIN [</span></strong><strong><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:18px;line-height:1.5;\">垠</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:18px;line-height:1.5;\">]</span></strong> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:18px;line-height:1.5;\">九行星宝石耳钉</span></strong> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:18px;line-height:1.5;\">因 你 而 转 的 黄 金 星 系</span></strong> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;line-height:1.5;font-size:12px;\">无际的夜空中</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;line-height:1.5;font-size:12px;\">有一颗行星映衬着金色的光辉</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;line-height:1.5;font-size:12px;\">闪耀在你的耳畔</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;line-height:1.5;font-size:12px;\">金色的轨道穿越细腻的耳垂</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;line-height:1.5;font-size:12px;\">天然的宝石守护着包裹双耳小小的宇宙</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;line-height:1.5;font-size:12px;\">温暖而优雅地为你散发光芒</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412173440_650.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;\"></span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\"><strong>水星 ·</strong></span><span style=\"font-size:16px;font-family:\'Microsoft YaHei\';color:#333333;\"> </span><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\"><strong>紫色 · 紫水晶</strong></span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:16px;\"><span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\"><strong>寂寞造</strong></span><span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\"><strong>就的旅行家</strong></span></span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">作为全系唯一没有天然卫星的行星，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">水星成为太阳系最寂寞的所在。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">她以最快的公转速度，如旅行家般执拗地围绕着太阳一圈一圈。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">淹没在耀眼阳光之中难得一见的她，弥漫着沉静且神秘的色彩。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">孤单属于她，紫色也属于她。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412173533_867.jpg\" alt=\"\" />\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">金星 ·</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:16px;\"> </span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">黄色 · 黄水晶</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">最闪耀的金色女神</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">她在夜空中比天狼星还要亮</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">14</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">倍，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">因为这份闪耀，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">古希腊人将她称为“女神”。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">是的，金星只是一颗不会发光的行星，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">却如水晶一般缀于夜幕，你无法忽视她那与生俱来的耀眼魅力。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412173856_372.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\"></span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">地球 ·</span><span style=\"font-size:16px;font-family:\'Microsoft YaHei\';\"> </span></b><b><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">绿色 · 橄榄石</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">满溢生机的平衡母体</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">这颗星球可能承载着整个太阳系最特殊的意义—生命。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">\r\n	<p align=\"center\" style=\"text-align:center;background:white;\">\r\n		象征生机的绿色用来代表地球再合适不过，\r\n	</p>\r\n	<p align=\"center\" style=\"text-align:center;background:white;\">\r\n		但绿色还有另一层含义，那就是恰如其分的平衡。\r\n	</p>\r\n	<p align=\"center\" style=\"text-align:center;background:white;\">\r\n		恰好的位置，恰好的速度，恰好的环境，恰好的一切，\r\n	</p>\r\n	<p align=\"center\" style=\"text-align:center;background:white;\">\r\n		才得以使其成为孕育生命的母体。\r\n	</p>\r\n</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\"></span> \r\n</p>\r\n<div style=\"text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412173927_292.jpg\" alt=\"\" /><br />\r\n</div>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\"></span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">火星 ·</span><span style=\"font-size:16px;font-family:\'Microsoft YaHei\';\"> </span><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">红色 · 石榴石</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">永不停息的探索者</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">古人将火星称为“荧惑”，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">这束充满着魅惑的红色光芒，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">吸引着世世代代对她永不停息地探索。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">火星给予人类的，不仅仅是激发无限探求欲的引诱，而是对于未知的遐想与憧憬。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">她是红色，她是魅惑，她是未知，她是火星。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#CCCCCC;\"> -----</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">木星 ·</span><span style=\"font-size:16px;font-family:\'Microsoft YaHei\';\"> </span><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">橙色 · 橙石榴</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">包容万象的皇后</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">木星稳重如皇后般的气场，不仅源于她巨大的质量与体积，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">更多是因为她的存在，其他行星才得以躲过大多数的天体撞击。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">而她独具韵味的带状大气，焕发多样光彩的同时，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">更展现出木星如皇后般能够包容万象的广阔胸襟。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412174103_497.jpg\" alt=\"\" />\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">土星 ·</span><span style=\"font-size:16px;\"> </span><span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">白色 · 白黄玉</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">光环包裹的隐士</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">太阳系八大行星中，土星传递着克制与自律的涵义，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">像一位隐士，被绚烂的光环包围着。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">这条独特的行星环，也成为土星最为出众的特征。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">优雅的弧线组成完满的圆，这种完满源自隐忍，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">而这份独特的美丽，则来自土星。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:Microsoft YaHei;\"><span style=\"color:#CCCCCC;font-family:\'Microsoft YaHei\';background-color:#FFFFFF;\">-----</span><br />\r\n</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">天王星\r\n·</span><span style=\"font-size:16px;font-family:\'Microsoft YaHei\';\"> </span><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">天</span></b><b><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">蓝色 · 托帕石</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">特立独行的吟游诗人</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">近乎横躺在自转轨道上的天王星，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">一直在用自己特有的方式，走着最为叛逆的道路。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">她不愿受到束缚，她向往着自由，她怀揣着浪漫情怀，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">希望成为吟游诗人，在太阳系边缘传唱特立独行的诗文。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412174151_859.jpg\" alt=\"\" />\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">海王星\r\n·</span><span style=\"font-size:16px;font-family:\'Microsoft YaHei\';\"> </span><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">深蓝色 · 蓝碧玺</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">冷峻优雅的贵族</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">作为一颗冰巨星，海王星寒冷而孤傲。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">充斥着甲烷的大气，在强大的气压之下，会形成令人无法想象的钻石雨。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">这场雨落于海王星的雨，是如此的高贵，却离我们那么的遥不可及。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">这种冷冽孤傲的优雅，正是海王星散发的魅力。</span> \r\n</p>\r\n<div style=\"text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412174219_43.jpg\" alt=\"\" /><br />\r\n</div>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">冥王星\r\n·</span><span style=\"font-size:16px;font-family:\'Microsoft YaHei\';\"> </span></b><b><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">黑色 · 黑玛瑙</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">若即若离的局外人</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">沉侵在最黑暗最幽冷的太阳系边缘，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">距离太阳最远的冥王星，却蕴含着最杂糅的气质。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">她冷漠，但她又执着地围绕着太阳；</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">她若即若离，但她又实实在在属于这里。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">冥王星的复杂，正如混合所有颜色后形成的黑，低调，却绚烂。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412174311_480.jpg\" alt=\"\" />\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">若你是创世主，你想在指间创造怎样的星系？</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">让炙热的火星点缀孤傲的海王星</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">让包容的木星陪伴寂寞的水星</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">让叛逆的天王星挑战自律的土星</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">让耀目的金星媲美我们的地球</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">或者，让一直处于边缘的冥王星成为星系的主宰</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">YIN垠以</span><span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">18K</span><span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">纯金，为冰冷的宇宙构筑温暖的轨迹</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">而精心打磨的天然彩色宝石，赋予每一颗行星属于自己的个性</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">但若你为恒星，想拥有怎样的行星家族？</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:14px;\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412174327_814.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:14px;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-size:12px;font-family:\'Microsoft YaHei\';\">Model/垠</span><span style=\"color:#64451D;font-size:12px;font-family:\'Microsoft YaHei\';\"> 004E</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-size:12px;font-family:\'Microsoft YaHei\';\"><strong>Product/ Skinny Gemstone&nbsp;Earrning&nbsp;极简天然宝石耳钉</strong></span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-size:12px;font-family:\'Microsoft YaHei\';\">Color/黄金</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-size:12px;font-family:\'Microsoft YaHei\';\">Material/ 18K Gold + Gem 18K金</span><span style=\"color:#64451D;font-size:12px;font-family:\'Microsoft YaHei\';\"> + </span><span style=\"color:#64451D;font-size:12px;font-family:\'Microsoft YaHei\';\">天然宝石</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-size:12px;font-family:\'Microsoft YaHei\';\">Specification/ 宝石边长</span><span style=\"color:#64451D;font-size:12px;font-family:\'Microsoft YaHei\';\">3mm</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-size:12px;font-family:\'Microsoft YaHei\';\">Inspiration/ The Solar System 宇宙太阳系九大行星</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412174348_507.jpg\" alt=\"\" />\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">关于</span><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">YIN</span><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">的包装</span></strong> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">手工打制的金属玻璃首饰盒</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">含有一丝原始古朴的气质</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">搭配极细黑色缎带</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">令存放首饰也可以成为一种展示</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412174410_182.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412174411_547.jpg\" alt=\"\" />\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">关于</span><span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">YIN</span></strong> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">造物的过程枯燥冗长。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">打磨器物的同时，</span><span style=\"line-height:1.5;font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">更是对人心的考验。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">成为建树深厚的造物者，</span><span style=\"line-height:1.5;\"><span style=\"font-family:\'Microsoft YaHei\';color:#333333;\"></span><span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">犹如涅槃成金，</span></span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">须历经乏味、艰辛、困顿甚至苦难。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">没有火炼，就无从证明真金本质。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">凡是曾被用心打造的器物，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">都是美于形，而精于心，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">就算它只是一枚小小的金戒</span><span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">……</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;\"><br />\r\n</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">极简</span></strong> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">单纯简洁是最打动人心的事物。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">不需要过度设计，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">也不用担心难以驾驭。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">纤细坚强的无限可能性，不言之力。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">Skinny, Delicate, Elegant.</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">YIN的金饰在被戴上的一刻，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">便已成为身体的一部分。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\"><br />\r\n</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;\"> </span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">暖金</span></strong> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">金一直被视为珍贵奢侈的象征。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">金的纯粹，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">以及它为人们带来的愉悦心态，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">如同落在指间的阳光一般。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">18K不褪色纯度的坚强与真实，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">YIN是带着温度的暖金。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\"><br />\r\n</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;\"> </span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">手工</span></strong> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">如果没有严苛到近似残酷的态度，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">那就不能被称作工艺。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">反复的锻造，打磨，雕琢，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">手工艺师的价值才能得以体现。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">而</span><span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">YIN</span><span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">真正的魅力在于，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">在极致细工质量的承诺同时，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">每件成品却有独一无二的感动细节。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\"><br />\r\n</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;\"> </span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">-----------------------------------------------------------------------------------------</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">YIN</span></strong><strong><span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">设计金饰</span></strong> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">垠</span><span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">-</span><span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">九行星宝石耳钉</span></strong> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">现已正式发布，欢迎预订，顺丰包邮。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">*首饰包装盒为手工制作铜架三角玻璃盒，请以实物为准</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;\"> </span> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<br />\r\n</p>', '1', '', '中国', '18K金', '暂无明细', '', '暂无明细', '2');
INSERT INTO `hs_model` VALUES ('493', '73', 'YIN 垠 九行星戒指', null, '1260.00', null, '78', '123', '123', '0', '5264', null, null, '0', '2016-04-06 16:40:27', '2', 'pWGQrYf320160413150432.jpg;QBkBXCcp20160413150432.jpg;7bw4Ov1E20160413150432.jpg;wwNhWJaK20160413150432.jpg;Q0Yk3l0V20160413150432.jpg;itI7KqRl20160413150432.jpg', '123', '2', null, 'YIN隐', '中国', null, null, null, null, '9', '0', '0', null, '戒指  Yin  九行星', '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"font-family:\'Microsoft YaHei\';font-size:18px;color:#64451D;\">YIN [</span></strong><strong><span style=\"font-family:\'Microsoft YaHei\';font-size:18px;color:#64451D;\">垠</span><span style=\"font-family:\'Microsoft YaHei\';font-size:18px;color:#64451D;\">]</span></strong> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"font-family:\'Microsoft YaHei\';font-size:18px;color:#64451D;\">九行星宝石戒指</span></strong> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412171401_490.jpg\" alt=\"\" /> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:18px;color:#64451D;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"font-size:14px;color:#333333;font-family:\'Microsoft YaHei\';\">因 你 而 转 的 黄 金 星 系</span></strong> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">纯金为轨道，宝石成星球</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">不求恒星的亘古不变</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">只愿如行星一般，围绕吾爱温暖地律动</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">可曾想过<span style=\"color:#333333;font-family:\'Microsoft YaHei\';background-color:#FFFFFF;\">，</span></span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">在璀璨无垠的宇宙中</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">有一颗行星，将绕着你的指尖运行</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412171604_11.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;color:#333333;\"></span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">水星 ·</span><span> </span><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">紫色 · 紫水晶</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">寂寞造就的旅行家</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">作为全系唯一没有天然卫星的行星，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">水星成为太阳系最寂寞的所在。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">她以最快的公转速度，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">如旅行家般执拗地围绕着太阳一圈一圈。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">淹没在耀眼阳光之中难得一见的她，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">弥漫着沉静且神秘的色彩。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">孤单属于她，紫色也属于她。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412171649_454.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<span style=\"font-size:12px;\"> \r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">金星 ·</span><span style=\"color:#333333;\"> </span><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">黄色 · 黄水晶</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">最闪耀的金色女神</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">她在夜空中比天狼星还要亮</span><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">14</span><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">倍，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">因为这份闪耀，古希腊人将她称为“女神”。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">是的，金星只是一颗不会发光的行星，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">却如水晶一般缀于夜幕，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">你无法忽视她那与生俱来的耀眼魅力。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412171745_510.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">地球 ·</span> </b><b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">绿色 · 橄榄石</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">满溢生机的平衡母体</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">这颗星球可能承载着整个太阳系最特殊的意义—生命。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">象征生机的绿色用来代表地球再合适不过，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">但绿色还有另一层含义，那就是恰如其分的平衡。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">恰好的位置，恰好的速度，恰好的环境，恰好的一切，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">才得以使其成为孕育生命的母体。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412171833_978.jpg\" alt=\"\" /> \r\n</p>\r\n</span><b> \r\n<div style=\"text-align:center;\">\r\n	<b><span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">火星 ·&nbsp;红色 · 石榴石</span></b> \r\n</div>\r\n</b><span style=\"font-family:\'Microsoft YaHei\';font-size:18px;color:#64451D;\"><span style=\"font-size:12px;\"><span style=\"color:#333333;\"> \r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">永不停息的探索者</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">古人将火星称为“荧惑”，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">这束充满着魅惑的红色光芒，</span><span style=\"line-height:1.5;\">吸引着世世代代对她永不停息地探索。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">火星给予人类的，不仅仅是激发无限探求欲的引诱，而是对于未知的遐想与憧憬。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">她是红色，她是魅惑，她是未知，她是火星。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412171928_338.jpg\" alt=\"\" /> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">木星 ·</span><span> </span><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">橙色 · 橙石榴</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">包容万象的皇后</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">木星稳重如皇后般的气场，不仅源于她巨大的质量与体积，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">更多是因为她的存在，其他行星才得以躲过大多数的天体撞击。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">而她独具韵味的带状大气，焕发多样光彩的同时，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">更展现出木星如皇后般能够包容万象的广阔胸襟。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412172000_297.jpg\" alt=\"\" /> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">土星 ·</span><span> </span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">白色 · 白黄玉</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">光环包裹的隐士</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">太阳系八大行星中，土星传递着克制与自律的涵义，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">像一位隐士，被绚烂的光环包围着。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">这条独特的行星环，也成为土星最为出众的特征。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">优雅的弧线组成完满的圆，这种完满源自隐忍，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">而这份独特的美丽，则来自土星。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412172032_122.jpg\" alt=\"\" /> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">天王星\r\n·</span><span> </span><span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">天</span></b><b><span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">蓝色 · 托帕石</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">特立独行的吟游诗人</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">近乎横躺在自转轨道上的天王星，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">一直在用自己特有的方式，走着最为叛逆的道路。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">她不愿受到束缚，她向往着自由，她怀揣着浪漫情怀，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">希望成为吟游诗人，在太阳系边缘传唱特立独行的诗文。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412172625_377.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">海王星\r\n·</span><span> </span><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">深蓝色 · 蓝碧玺</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">冷峻优雅的贵族</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">作为一颗冰巨星，海王星寒冷而孤傲。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">充斥着甲烷的大气，在强大的气压之下，会形成令人无法想象的钻石雨。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">这场雨落于海王星的雨，是如此的高贵，却离我们那么的遥不可及。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">这种冷冽孤傲的优雅，正是海王星散发的魅力。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412172710_160.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n</span></span></span> \r\n<p style=\"text-align:center;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:18px;color:#64451D;\"><span style=\"font-size:12px;\"><span style=\"color:#333333;\"></span></span></span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">冥王星\r\n·</span><span> </span></b><b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">黑色 · 黑玛瑙</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">若即若离的局外人</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">沉侵在最黑暗最幽冷的太阳系边缘，距离太阳最远的冥王星，却蕴含着最杂糅的气质。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">她冷漠，但她又执着地围绕着太阳；她若即若离，但她又实实在在属于这里。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">冥王星的复杂，正如混合所有颜色后形成的黑，低调，却绚烂。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412172759_805.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:18px;color:#64451D;\"></span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">若你是创世主，你想在指间创造怎样的星系？</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">让炙热的火星点缀孤傲的海王星</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">让包容的木星陪伴寂寞的水星</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">让叛逆的天王星挑战自律的土星</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">让耀目的金星媲美我们的地球</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">或者，让一直处于边缘的冥王星成为星系的主宰</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">YIN垠以</span><span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">18K</span><span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">纯金，为冰冷的宇宙构筑温暖的轨迹</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">而精心打磨的天然彩色宝石，赋予每一颗行星属于自己的个性</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">但若你为恒星，想拥有怎样的行星家族？</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412172854_420.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412172855_958.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<span style=\"font-size:12px;color:#333333;\"> \r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">Model/垠</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\"> 004R</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\"><strong>Product/ Skinny Gemstone Ring 极简天然宝石戒指</strong></span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">Color/黄金</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">Material/ 18K Gold + Gem 18K金</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\"> + </span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">天然宝石</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">Specification/ 宝石边长</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">3mm,</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">戒</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">0.65-0.7mm</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">Size / 6-16 (可定制</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">,</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">请联系店主）</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">Inspiration/ The Solar System 宇宙太阳系九大行星</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412172922_158.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412173040_401.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;\"></span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">关于</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">YIN</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">的包装</span></strong> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">藏在信封中的低调的戒指</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">小心放入手工打制的金属玻璃首饰盒</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">含有一丝原始古朴的气质</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">搭配极细黑色缎带</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">令存放首饰也可以成为一种展示</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412172947_301.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412172948_569.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;\"></span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">关于</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">YIN</span></strong> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">造物的过程枯燥冗长。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">打磨器物的同时，</span><span style=\"font-family:\'Microsoft YaHei\';line-height:1.5;\">更是对人心的考验。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">成为建树深厚的造物者，</span><span style=\"font-family:\'Microsoft YaHei\';line-height:1.5;\">犹如涅槃成金，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">须历经乏味、艰辛、困顿甚至苦难。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">没有火炼，就无从证明真金本质。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">凡是曾被用心打造的器物，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">都是美于形，而精于心，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">就算它只是一枚小小的金戒</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">……</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<br />\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;\"> </span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">极简</span></strong> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">单纯简洁是最打动人心的事物。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">不需要过度设计，</span><span style=\"font-family:\'Microsoft YaHei\';line-height:1.5;\">也不用担心难以驾驭。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">纤细坚强的无限可能性，不言之力。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">Skinny, Delicate, Elegant.</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">YIN的金饰在被戴上的一刻，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">便已成为身体的一部分。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\"><br />\r\n</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;\"> </span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">暖金</span></strong> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">金一直被视为珍贵奢侈的象征。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">金的纯粹，</span><span style=\"font-family:\'Microsoft YaHei\';line-height:1.5;\">以及它为人们带来的愉悦心态，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">如同落在指间的阳光一般。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">18K不褪色纯度的坚强与真实，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">YIN是带着温度的暖金。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\"><br />\r\n</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;\"> </span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">手工</span></strong> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">如果没有严苛到近似残酷的态度，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">那就不能被称作工艺。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">反复的锻造，打磨，雕琢，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">手工艺师的价值才能得以体现。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">而</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">YIN</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">真正的魅力在于，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">在极致细工质量的承诺同时，</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">每件成品却有独一无二的感动细节。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\"><br />\r\n</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;\"> </span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">-----------------------------------------------------------------------------------------</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\"><strong>［发货说明］</strong></span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">＊所有款式均为定制和手工制作。</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">＊下单付款后开始定制，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">7-15</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">天内寄出，顺丰包邮。</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">＊首饰包装盒为手工制作玻璃金字塔盒，</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">可能出现手工漆色因运输少有脱落，属正常现象。</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\"><strong>［退换货标准］</strong></span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">＊每一件均为手工精心制作，请注意产品规格，</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">不接受因为自我佩戴观感和主观喜好的退货理由，非质量问题不退货。</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">＊本店使用香港标准尺码，请务必对照周长或直径尺寸选择。</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">＊定制尺寸或刻字请具体沟通。</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">＊如大小不合适可免费更换，往返邮费需客人出。</span> \r\n</p>\r\n<span style=\"color:#333333;\"> \r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">＊如出现质量问题可免费维修，邮费设计师出。</span> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<br />\r\n</p>\r\n</span></span>', '1', '', '中国', '18K金', '暂无明细', '', '暂无明细', '2');
INSERT INTO `hs_model` VALUES ('494', '73', 'YIN 垠 九行星项链', null, '2660.00', null, '79', '123', '123', '0', '5264', null, null, '0', '2016-04-06 16:55:12', '2', 'x8B8taxW20160412164857.jpg;uN7bq4ny20160412164857.jpg;1wZ6iGIT20160412164857.jpg;9al69seY20160412164858.jpg;FiZdsETH20160412164923.jpg', '123', '2', null, 'YIN隐', '中国', null, null, null, null, '9', '0', '0', null, '项链 Yin 九行星', '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-size:18px;font-family:\'Microsoft YaHei\';line-height:1.5;\"><strong>YIN [</strong></span><span style=\"color:#64451D;font-size:18px;font-family:\'Microsoft YaHei\';line-height:1.5;\"><strong>垠</strong></span><span style=\"color:#64451D;font-size:18px;font-family:\'Microsoft YaHei\';line-height:1.5;\"><strong>]</strong></span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-size:18px;font-family:\'Microsoft YaHei\';line-height:1.5;\"><strong><span style=\"font-family:Microsoft YaHei;\">九行星宝石项</span><span style=\"font-family:\'Microsoft YaHei\';\">链</span></strong></span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-size:18px;font-family:\'Microsoft YaHei\';line-height:1.5;\"><strong>因 你 而 转 的 黄 金 星 系</strong></span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">修长的项背曲线</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">凌冽的锁骨凹槽</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">勾勒出环绕项颈的优雅宇宙</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">而温暖的金色线条</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">明晰的彩色宝石</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">被优雅的引力牵引着</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">默默为你旋转</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">为你美丽</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"font-family:Microsoft YaHei;\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412165443_824.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<span style=\"font-family:Microsoft YaHei;\"> \r\n<div style=\"text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412165511_922.jpg\" alt=\"\" /><br />\r\n</div>\r\n<span style=\"line-height:1.5;\"> \r\n<p>\r\n	<span style=\"line-height:1.5;\"> </span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;\">水星 ·</span><span style=\"color:#333333;\"> </span><span style=\"color:#333333;\">紫色 · 紫水晶</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;\">寂寞造就的旅行家</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;\">作为全系唯一没有天然卫星的行星，水星成为太阳系最寂寞的所在。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;\">她以最快的公转速度，如旅行家般执拗地围绕着太阳一圈一圈。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;\">淹没在耀眼阳光之中难得一见的她，弥漫着沉静且神秘的色彩。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;\">孤单属于她，紫色也属于她。</span>\r\n</p>\r\n</span></span>\r\n<p style=\"text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412165612_630.jpg\" alt=\"\" />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;\"></span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">金星 ·</span><span style=\"color:#333333;\"> </span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">黄色 · 黄水晶</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">最闪耀的金色女神</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">她在夜空中比天狼星还要亮</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">14</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">倍，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">因为这份闪耀，古希腊人将她称为“女神”。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">是的，金星只是一颗不会发光的行星，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">却如水晶一般缀于夜幕，你无法忽视她那与生俱来的耀眼魅力。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\"><span style=\"color:#CCCCCC;background-color:#FFFFFF;\">-----</span><br />\r\n</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">地球 ·</span><span style=\"color:#333333;\"> </span></b><b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">绿色 · 橄榄石</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">满溢生机的平衡母体</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">这颗星球可能承载着整个太阳系最特殊的意义—生命。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">象征生机的绿色用来代表地球再合适不过，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">但绿色还有另一层含义，那就是恰如其分的平衡。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">恰好的位置，恰好的速度，恰好的环境，恰好的一切，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">才得以使其成为孕育生命的母体。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\"><span style=\"color:#CCCCCC;font-family:\'Microsoft YaHei\';background-color:#FFFFFF;\">-----</span><br />\r\n</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">火星 ·</span><span style=\"color:#333333;\"> </span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">红色 · 石榴石</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">永不停息的探索者</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">古人将火星称为“荧惑”，</span><span style=\"line-height:1.5;color:#333333;font-family:\'Microsoft YaHei\';\">这束充满着魅惑的红色光芒，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-family:\'Microsoft YaHei\';\">吸引着世世代代对她永不停息地探索。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">火星给予人类的，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-family:\'Microsoft YaHei\';\">不仅仅是激发无限探求欲的引诱，</span><span style=\"line-height:1.5;color:#333333;font-family:\'Microsoft YaHei\';\">而是对于未知的遐想与憧憬。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-family:\'Microsoft YaHei\';\">她是红色，她是魅惑，她是未知，她是火星。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\"><span style=\"color:#CCCCCC;font-family:\'Microsoft YaHei\';background-color:#FFFFFF;\">-----</span><br />\r\n</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">木星 ·</span><span style=\"color:#333333;\"> </span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">橙色 · 橙石榴</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">包容万象的皇后</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">木星稳重如皇后般的气场，不仅源于她巨大的质量与体积，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">更多是因为她的存在，其他行星才得以躲过大多数的天体撞击。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">而她独具韵味的带状大气，焕发多样光彩的同时，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">更展现出木星如皇后般能够包容万象的广阔胸襟。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412170108_157.jpg\" alt=\"\" /></span><span style=\"line-height:1.5;\"></span>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;\"></span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">土星 ·</span><span style=\"color:#333333;\"> </span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">白色 · 白黄玉</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">光环包裹的隐士</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">太阳系八大行星中，土星传递着克制与自律的涵义，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">像一位隐士，被绚烂的光环包围着。</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">这条独特的行星环，也成为土星最为出众的特征。</span> \r\n</p>\r\n<span style=\"color:#333333;\">\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-family:\'Microsoft YaHei\';\">优雅的弧线组成完满的圆，这种完满源自隐忍，</span>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-family:\'Microsoft YaHei\';\">而这份独特的美丽，则来自土星。</span>\r\n</p>\r\n</span>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;\"><span style=\"color:#333333;\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412170137_531.jpg\" alt=\"\" /><br />\r\n</span></span> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;\"><span style=\"color:#333333;\"></span></span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">天王星\r\n·</span><span> </span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">天</span></b><b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">蓝色 · 托帕石</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">特立独行的吟游诗人</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">近乎横躺在自转轨道上的天王星，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">一直在用自己特有的方式，走着最为叛逆的道路。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">她不愿受到束缚，她向往着自由，她怀揣着浪漫情怀，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">希望成为吟游诗人，在太阳系边缘传唱特立独行的诗文。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412170159_284.jpg\" alt=\"\" />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;\"><span style=\"color:#333333;\"></span></span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">海王星\r\n·</span><span> </span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">深蓝色 · 蓝碧玺</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">冷峻优雅的贵族</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">作为一颗冰巨星，海王星寒冷而孤傲。充斥着甲烷的大气，在强大的气压之下，会形成令人无法想象的钻石雨。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">这场雨落于海王星的雨，是如此的高贵，却离我们那么的遥不可及。这种冷冽孤傲的优雅，正是海王星散发的魅力。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412170356_377.jpg\" alt=\"\" /><br />\r\n</span>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;\"><span style=\"color:#333333;\"></span></span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">冥王星\r\n·</span><span> </span></b><b><span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">黑色 · 黑玛瑙</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<b><span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">若即若离的局外人</span></b> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">沉侵在最黑暗最幽冷的太阳系边缘，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">距离太阳最远的冥王星，却蕴含着最杂糅的气质。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">她冷漠，但她又执着地围绕着太阳；</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">她若即若离，但她又实实在在属于这里。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">冥王星的复杂，正如混合所有颜色后形成的黑，低调，却绚烂。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412170443_597.jpg\" alt=\"\" /><br />\r\n</span>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;\"><span style=\"color:#333333;\"></span></span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">若你是创世主，你想在指间创造怎样的星系？</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">让炙热的火星点缀孤傲的海王星</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">让包容的木星陪伴寂寞的水星</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">让叛逆的天王星挑战自律的土星</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">让耀目的金星媲美我们的地球</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">或者，让一直处于边缘的冥王星成为星系的主宰</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">YIN垠以</span><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">18K</span><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">纯金，为冰冷的宇宙构筑温暖的轨迹</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">而精心打磨的天然彩色宝石，赋予每一颗行星属于自己的个性</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">但若你为恒星，想拥有怎样的行星家族？</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412170516_397.jpg\" alt=\"\" /><br />\r\n</span>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;\"><span style=\"color:#333333;\"></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\"><strong>Model/垠</strong></span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\"><strong> 004N</strong></span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\"><strong>Product/ Skinny Gemstone Necklace 极简天然宝石项链</strong></span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">Color/黄金</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">Material/ 18K Gold + Gem 18K金</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\"> + </span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">天然宝石</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">Specification/ 宝石边长</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">3mm</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">Size/ 链长</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\"> 40</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">厘米</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\"> 42</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">厘米</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">Inspiration/ The Solar System 宇宙太阳系九大行星</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412170618_558.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;\"></span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">关于</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">YIN</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">的包装</span></strong> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">手工打制的金属玻璃首饰盒</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">含有一丝原始古朴的气质</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">搭配极细黑色缎带</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">令存放首饰也可以成为一种展示</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412170721_534.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412170723_177.jpg\" alt=\"\" /><br />\r\n</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">关于</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">YIN</span></strong>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">造物的过程枯燥冗长。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">打磨器物的同时，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">更是对人心的考验。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">成为建树深厚的造物者，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">犹如涅槃成金，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">须历经乏味、艰辛、困顿甚至苦难。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">没有火炼，就无从证明真金本质。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">凡是曾被用心打造的器物，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">都是美于形，而精于心，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">就算它只是一枚小小的金戒</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">……</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\"><br />\r\n</span></strong>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">极简</span></strong>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">单纯简洁是最打动人心的事物。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">不需要过度设计，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">也不用担心难以驾驭。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">纤细坚强的无限可能性，不言之力。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">Skinny, Delicate, Elegant.</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">&nbsp;YIN的金饰在被戴上的一刻，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">便已成为身体的一部分。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<br />\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">暖金</span></strong> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">金一直被视为珍贵奢侈的象征。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">金的纯粹，</span><span style=\"line-height:1.5;color:#333333;font-family:\'Microsoft YaHei\';\"></span><span style=\"line-height:1.5;color:#333333;font-family:\'Microsoft YaHei\';\">以及它为人们带来的愉悦心态，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">如同落在指间的阳光一般。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">18K不褪色纯度的坚强与真实，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">YIN是带着温度的暖金。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<br />\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">手工</span></strong> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">如果没有严苛到近似残酷的态度，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">那就不能被称作工艺。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">反复的锻造，打磨，雕琢，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">手工艺师的价值才能得以体现。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">而</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">YIN</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">真正的魅力在于，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">在极致细工质量的承诺同时，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">每件成品却有独一无二的感动细节。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\"><br />\r\n</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">-----------------------------------------------------------------------------------------</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\"><strong>［发货说明］</strong></span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">＊所有款式均为定制和手工制作。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">＊下单付款后开始定制，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">7-15</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">天内寄出，顺丰包邮。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">＊首饰包装盒为手工制作玻璃金字塔盒，</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">可能出现手工漆色因运输少有脱落，属正常现象。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\"><strong>［退换货标准］</strong></span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">＊每一件均为手工精心制作，请注意产品规格，</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">不接受因为自我佩戴观感和主观喜好的退货理由，非质量问题不退货。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">＊本店使用香港标准尺码，请务必对照周长或直径尺寸选择。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">＊定制尺寸或刻字请具体沟通。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">＊如大小不合适可免费更换，往返邮费需客人出。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">＊如出现质量问题可免费维修，邮费设计师出。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\"><br />\r\n</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\"><br />\r\n</span>\r\n</p>', '1', '', '中国', '18K金', '暂无明细', '', '暂无明细', '2');
INSERT INTO `hs_model` VALUES ('495', '73', 'YIN 瀛 日式美学手链', null, '1860.00', null, '79', '123', '123', '0', '5264', null, null, '0', '2016-04-06 17:09:23', '1', 'Lmbfvoug20160412150623.jpg;CQQ8AF8E20160412150623.jpg;SzkNc92g20160412150623.jpg;WkUIupq720160412150623.jpg;OD7z7SBm20160412150623.jpg', '123', '2', null, 'YIN隐', '中国', null, null, null, null, '8', '0', '0', null, '手链 Yin 瀛 日式美学', '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"font-family:\'Microsoft YaHei\';font-size:18px;color:#64451D;\">YIN [</span></strong><strong><span style=\"font-family:\'Microsoft YaHei\';font-size:18px;color:#64451D;\">瀛</span><span style=\"font-family:\'Microsoft YaHei\';font-size:18px;color:#64451D;\">]</span></strong> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"font-family:\'Microsoft YaHei\';font-size:18px;color:#64451D;\">日式美学手链</span></strong> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:18px;color:#64451D;\"><img src=\"/upload/uploadImg/modeldetail/image/20160406/20160406170411_90.jpg\" alt=\"\" /></span> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:18px;color:#64451D;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">物哀，空寂，闲寂，幽玄，构筑成日本传统美学</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">皆为“无”的变体</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">稍纵即逝的樱吹雪</span><span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\"> -- </span><span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">圆</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">连绵清绝的山脊</span><span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\"> -- </span><span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">长方</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">古朴简素的枯山水</span><span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\"> -- </span><span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">正方</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">含蓄深邃的远山</span><span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\"> -- </span><span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">三角</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;color:#333333;font-family:\'Microsoft YaHei\';\">古典现代，极简优雅，佛欲禅意</span> \r\n</p>\r\n<span style=\"color:#333333;\"> \r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">被纤细金链锁于颈边腕间</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">若红尘太过喧闹</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">瀛 给你留白</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412150810_612.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">[</span></strong><strong><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">物哀•圆</span><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">]</span></strong> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">现世飘渺</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">归意为幻觉</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">皆归结于物哀</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">世界上只有无限接近的圆，没有真正的圆</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">看起来如此圆满的图形，亦有残缺</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">但这圆形的金却着实暖，着实绮丽</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">玉腕翻转出幻觉般的浮世绘</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">若现世已如此虚无</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">就以圆形暖金，粉饰幻觉，淡化忧愁</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412150848_478.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<span style=\"font-size:12px;\"> \r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">[</span></strong><strong><span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">空寂•长方</span><span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">]</span></strong> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">绘画中的枯淡之美</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">造园中的无相之美</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">皆归于空无</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">长方形，狭长留白</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">仿若岛国南北狭长腹地</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">细看，上面有山脊，红叶，积雪，雾霭</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">转瞬之间，又归于无</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">而这一片长方形，细长，古雅的金色土壤</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">于腕间生长出世间的万象</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412150922_910.jpg\" alt=\"\" />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">[</span></strong><strong><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">闲寂•正方</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">]</span></strong> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">枯山水庭院的和静之境</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">简素枯高，去杂化简</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">是对悲苦浮世的卓然超越</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">石是孤石，庭院是简素</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">这一枚边角分明的正方</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">是一座由腕通向心的悬桥</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">向前是和静清寂，方方正正的内心</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">回首是喧闹绮丽的浮世</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">皆如梦残痕</span>\r\n</p>\r\n</span></span><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412150947_646.jpg\" alt=\"\" /><br />\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\"></span><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">[</span></strong><strong><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">幽玄•三角</span><span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">]</span></strong> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">般若幽玄，深奥的优美</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">三角，锐利却最稳定的形状</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">任一锐角成为弦</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">弦，玄</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">竹间小小三角倒影</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">是山峦，山林渐次，烟雾升起</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">这般常见的尘世象</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">却如能剧面具下的余情</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">深幽含蓄的情感和边角，在有限的时空里</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-size:12px;font-family:\'Microsoft YaHei\';color:#333333;\">亦有无限的情情趣趣</span>\r\n</p>\r\n<div style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412151119_114.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412151119_29.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412151119_539.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412151119_638.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412151124_377.jpg\" alt=\"\" /></span>\r\n</div>\r\n<p style=\"text-align:center;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:18px;color:#64451D;\"><span style=\"color:#333333;\"><span style=\"font-size:12px;\"></span></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">Model/瀛</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">003N 003B</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">Product/ Skinny Necklace &amp; Bracelet极简几何金片项链</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">/</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">手链</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">Color/黄金</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">Fabric/ 18K金</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">Bracelet Size/ 15cm 17cm</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';font-size:12px;\">Inspiration/ 日式侘寂美学</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;\">-------------------------------------------------------------</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"font-family:\'Microsoft YaHei\';font-size:12px;\">关于</span><span style=\"font-family:\'Microsoft YaHei\';font-size:12px;\">YIN</span><span style=\"font-family:\'Microsoft YaHei\';font-size:12px;\">的包装</span></strong> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;\">藏在信封中的低调的金饰</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;\">小心放入手工打制的金属玻璃首饰盒</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;\">含有一丝原始古朴的气质</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;\">搭配极细黑色缎带</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;\">令存放首饰也可以成为一种展示</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412151159_919.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412151159_160.jpg\" alt=\"\" />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">关于</span><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">YIN</span></strong> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">造物的过程枯燥冗长。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">打磨器物的同时，</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">更是对人心的考验。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">成为建树深厚的造物者，</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">犹如涅槃成金，</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">须历经乏味、艰辛、困顿甚至苦难。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">没有火炼，就无从证明真金本质。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">凡是曾被用心打造的器物，</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">都是美于形，而精于心，</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">就算它只是一枚小小的金戒……</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">极简</span></strong> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">单纯简洁是最打动人心的事物。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">不需要过度设计，</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">也不用担心难以驾驭。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">纤细坚强的无限可能性，不言之力。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">Skinny, Delicate, Elegant.</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">YIN的金饰在被戴上的一刻，</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">便已成为身体的一部分。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">暖金</span></strong> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">金一直被视为珍贵奢侈的象征。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">金的纯粹，</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">以及它为人们带来的愉悦心态，</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">如同落在指间的阳光一般。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">18K不褪色纯度的坚强与真实，</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">YIN是带着温度的暖金。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">手工</span></strong> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">如果没有严苛到近似残酷的态度，</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">那就不能被称作工艺。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">反复的锻造，打磨，雕琢，</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">手工艺师的价值才能得以体现。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">而</span><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">YIN</span><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">真正的魅力在于，</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">在极致细工质量的承诺同时，</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">每件成品却有独一无二的感动细节。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">-----------------------------------------------------------------------------------------</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">YIN</span></strong><strong><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">设计金饰</span></strong> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">瀛</span><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">-</span><span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">日式美学手链</span></strong> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">现已正式上架，欢迎订购，顺丰包邮。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">*首饰包装盒为手工制作铜架三角玻璃盒，请以实物为准</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">*定制尺寸或刻字服务请与店主具体沟通</span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span> </span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '1', '', '中国', '18K金', '圆15cm  圆17cm  正方15cm  正方17cm  三角15cm  三角17cm  长方15cm  长方17cm', '', '暂无明细', '2');
INSERT INTO `hs_model` VALUES ('496', '73', 'YIN盈 月相球戒指', null, '1460.00', null, '78', '123', '123', '0', '5264', null, null, '0', '2016-04-06 17:19:45', '1', 'n80zC8OV20160412150038.jpg;6k0Iswil20160412150038.jpg;5VGHIxJ320160412150038.jpg;kxTAAfPW20160412150038.jpg;gzpoBll020160412150038.jpg', '123', '2', null, 'YIN隐', '中国', null, null, null, null, '1', '0', '0', null, '戒指 设计 Yin 月相球', '<p style=\"text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412150102_735.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412150102_928.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412150106_440.jpg\" alt=\"\" />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412150414_536.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412150414_986.jpg\" alt=\"\" />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412150113_235.jpg\" alt=\"\" />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412150302_636.jpg\" alt=\"\" />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412150314_198.jpg\" alt=\"\" />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412150328_272.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412150328_138.jpg\" alt=\"\" />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412150356_76.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412150356_859.jpg\" alt=\"\" />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412150459_909.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412150511_752.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412150511_682.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412150511_194.jpg\" alt=\"\" />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<br />\r\n</p>', '1', '', '中国', '18K金', '请将具体尺寸填写在订单备注中', '', '暂无明细', '2');
INSERT INTO `hs_model` VALUES ('497', '73', 'YIN 隐 莫比乌斯手镯', null, '5560.00', null, '80', '123', '123', '0', '5264', null, null, '0', '2016-04-06 17:30:27', '1', '2uh6GkNz20160412143657.jpg;tevh9gJn20160412143657.jpg;UL5iEJr220160412143657.jpg;1T71B3tg20160412143803.jpg', '123', '2', null, 'YIN隐', '中国', null, null, null, null, '4', '0', '0', null, '手镯  YIN  莫比乌斯  手环', '<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-size:18px;font-family:\'Microsoft YaHei\';\"><strong>YIN</strong></span><span style=\"color:#64451D;font-size:18px;font-family:\'Microsoft YaHei\';\"><strong>隐</strong></span><span style=\"color:#64451D;font-size:18px;font-family:\'Microsoft YaHei\';\"><strong>-</strong></span><span style=\"color:#64451D;font-size:18px;font-family:\'Microsoft YaHei\';\"><strong>莫比乌斯手镯</strong></span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;\">这一次，创造永恒时空的，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;\">不再只是一枚小小金戒</span><span style=\"font-family:\'Microsoft YaHei\';color:#333333;\">……</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">拓扑学符号莫比乌斯环。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';line-height:1.5;color:#333333;\">一条具有两面的丝带，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';line-height:1.5;color:#333333;\">在经过扭转之后，即成为一个平面。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;\">这个平面没有开始与结尾，</span><span style=\"font-family:\'Microsoft YaHei\';line-height:1.5;color:#333333;\">循环往复且无止无休，</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"font-family:\'Microsoft YaHei\';color:#333333;\">因此“∞”被定义为无限大的同时，</span><span style=\"font-family:\'Microsoft YaHei\';line-height:1.5;color:#333333;\">也象征亘古永恒。</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"font-family:Microsoft YaHei;\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412144245_216.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412144245_600.jpg\" alt=\"\" /><br />\r\n</span>\r\n</p>\r\n<p align=\"center\" style=\"margin-left:14.2pt;text-align:center;text-indent:-14.2pt;\">\r\n	<br />\r\n</p>\r\n<p align=\"center\" style=\"margin-left:14.2pt;text-align:center;text-indent:-14.2pt;\">\r\n	<span style=\"color:#333333;\"></span> \r\n</p>\r\n<p align=\"center\" style=\"font-family:\'Microsoft YaHei\';text-align:center;background-color:white;\">\r\n	<span style=\"color:#333333;\">由线到面，由面及体，这是莫比乌斯给予人类思维的拓展</span> \r\n</p>\r\n<p align=\"center\" style=\"font-family:\'Microsoft YaHei\';text-align:center;background-color:white;\">\r\n	<span style=\"color:#333333;\">对</span><span style=\"color:#333333;\">YIN</span><span style=\"color:#333333;\">而言，也是从一枚小小的戒指起始，开拓了这段奇妙的旅程</span> \r\n</p>\r\n<p align=\"center\" style=\"font-family:\'Microsoft YaHei\';text-align:center;background-color:white;\">\r\n	<span style=\"color:#333333;\">莫比乌斯所创造的空间，没有来头也无去处，循环往复亦永恒不止</span> \r\n</p>\r\n<p align=\"center\" style=\"font-family:\'Microsoft YaHei\';text-align:center;background-color:white;\">\r\n	<span style=\"color:#333333;\">而</span><span style=\"color:#333333;\">YIN</span><span style=\"color:#333333;\">隐戒指与手镯间的传承与延展，恰如莫比乌斯对无限与永恒的精准演绎</span> \r\n</p>\r\n<p align=\"center\" style=\"font-family:\'Microsoft YaHei\';text-align:center;background-color:white;\">\r\n	<span style=\"color:#333333;\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412144400_414.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412144400_908.jpg\" alt=\"\" /><br />\r\n</span>\r\n</p>\r\n<div style=\"font-family:\'Microsoft YaHei\';text-align:center;padding:0cm;background-color:white;\">\r\n	<p align=\"center\">\r\n		<span style=\"color:#333333;\">YIN隐</span><span style=\"color:#333333;\">-</span><span style=\"color:#333333;\">莫比乌斯手镯令宏大的时空概念更加宏大。</span> \r\n	</p>\r\n</div>\r\n<p align=\"center\" style=\"font-family:\'Microsoft YaHei\';text-align:center;background-color:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">延续极致简约的设计，拉伸纤细的旋转环身，令无限空间在腕间蔓延</span> \r\n</p>\r\n<p align=\"center\" style=\"margin-left:30pt;font-family:\'Microsoft YaHei\';text-align:center;text-indent:-14.2pt;background-color:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">温暖的</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">18K</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">纯金，永不褪色的亘古承诺，演绎海纳百川的空间概念</span> \r\n</p>\r\n<p align=\"center\" style=\"margin-left:14.2pt;text-align:center;text-indent:-14.2pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">精进的工艺，纯粹的扭转，细致的打磨，定义永恒绵延的时与空</span>\r\n</p>\r\n<p align=\"center\" style=\"margin-left:14.2pt;text-align:center;text-indent:-14.2pt;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412144456_736.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412144506_376.jpg\" alt=\"\" /><br />\r\n</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background-color:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">从一枚小小的戒指开始，YIN踏上一段美妙的旅程</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background-color:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';\">现在，YIN用这枚莫比乌斯手镯，回溯过往，完整现在，定义未来…</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background-color:white;\">\r\n	<span style=\"line-height:2.5;color:#CCCCCC;font-family:Arial;font-size:10px;\"><span style=\"color:#333333;font-size:14px;line-height:2;\"><span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:2;background-color:#FFFFFF;\">-----------------------------------------------------------------------------------------</span></span><span style=\"color:#64451D;font-family:Arial;line-height:25px;font-size:14px;background-color:#FFFFFF;\"></span></span>\r\n</p>\r\n<p align=\"center\" style=\"margin-left:14.2pt;text-align:center;text-indent:-14.2pt;\">\r\n	<br />\r\n</p>\r\n<p align=\"center\" style=\"margin-left:14.2pt;text-align:center;text-indent:-14.2pt;\">\r\n	<span style=\"color:#333333;\"></span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';\">YIN Model/ </span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';\">隐</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';\">001B</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';\">Product/ Bracelet </span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';\">手镯</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';\">Material/ 18K</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';\">金</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';\">Specification/</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';\">窄版</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';\">3mm</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';\">；宽版</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';\">5mm</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';\">Size/ 16cm</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';\">；</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';\">18cm (</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';\">可定制，请联系店主</span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';\">)</span> \r\n</p>\r\n<div style=\"border:none;padding:0cm 0cm 0cm 0cm;background:white;\">\r\n	<p align=\"center\" style=\"text-align:center;\">\r\n		<span style=\"color:#64451D;font-family:\'Microsoft YaHei\';\">Inspiration/ Mobius </span><span style=\"color:#64451D;font-family:\'Microsoft YaHei\';\">莫比乌斯环</span> \r\n	</p>\r\n</div>\r\n<span style=\"color:#64451D;\"> \r\n<div style=\"text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412144558_494.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412144558_10.jpg\" alt=\"\" /><br />\r\n</div>\r\n</span>\r\n<p align=\"center\" style=\"margin-left:14.2pt;text-align:center;text-indent:-14.2pt;\">\r\n	<span style=\"color:#333333;\"><span style=\"color:#64451D;\"></span></span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">关于</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">YIN</span></strong> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">造物的过程枯燥冗长。</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">打磨器物的同时，</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">更是对人心的考验。</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">成为建树深厚的造物者，</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">犹如涅槃成金，</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">须历经乏味、艰辛、困顿甚至苦难。</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">没有火炼，就无从证明真金本质。</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">凡是曾被用心打造的器物，</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">都是美于形，而精于心，</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">就算它只是一枚小小的金戒……</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">极简</span></strong> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">单纯简洁是最打动人心的事物。</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">不需要过度设计，</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">也不用担心难以驾驭。</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">纤细坚强的无限可能性，不言之力。</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">Skinny, Delicate, Elegant.</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">YIN的金饰在被戴上的一刻，</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">便已成为身体的一部分。</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">暖金</span></strong> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">金一直被视为珍贵奢侈的象征。</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">金的纯粹，</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">以及它为人们带来的愉悦心态，</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">如同落在指间的阳光一般。</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;\"><span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">18K不褪</span><span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">色纯度的坚强与</span><span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">真实，</span></span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">YIN是带着温度的暖金。</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">手工</span></strong> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">如果没有严苛到近似残酷的态度，</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">那就不能被称作工艺。</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">反复的锻造，打磨，雕琢，</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">手工艺师的价值才能得以体现。</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">而</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">YIN</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">真正的魅力在于，</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">在极致细工质量的承诺同时，</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">每件成品却有独一无二的感动细节。</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">-----------------------------------------------------------------------------------------</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">YIN</span></strong><strong><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">设计金饰</span></strong> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<strong><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">隐</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">-</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">莫比乌斯手镯</span></strong> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">现已正式上架，欢迎订购，顺丰包邮。</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">*首饰包装盒为手工制作铜架玻璃盒，请以实物为准</span> \r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\">*定制尺寸或刻字服务请与店主具体沟通</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\"><br />\r\n</span>\r\n</p>\r\n<p align=\"center\" style=\"text-align:center;background:white;\">\r\n	<span style=\"color:#333333;font-family:\'Microsoft YaHei\';font-size:12px;\"><br />\r\n</span>\r\n</p>', '1', '', '中国', '18K金', '3mm*16cm/3mm*18cm/5mm*16cm/5mm*18cm', '', '暂无明细', '2');
INSERT INTO `hs_model` VALUES ('498', '73', '狐狸戒指', null, '3180.00', null, '78', '123', '123', '0', '5269', null, null, '1', '2016-04-06 17:59:44', '1', '64lP1Mei20160411173904.jpg;ZoNOI0bS20160411173905.jpg;VjE5gK5w20160411173906.jpg', '123', '2', null, '刘周珠宝', '北京', null, null, null, null, '5', '0', '0', null, '趣味 定制', '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">狐狸，聪慧 机敏的化身</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">这只戒指的创意源自一个深夜的梦</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">在作者的梦境中一只狐狸在不断的奔跑，越跑越近</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">最终幻化成为一只戒指</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">梦醒后，作者在深夜便将这只狐狸的形态用橡皮保留了下来</span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">而后制作成这枚戒指</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\"><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411173949_214.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411173950_604.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411173950_813.jpg\" alt=\"\" /><br />\r\n</span>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">狐狸，有催生爱情的功</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;\">\r\n	<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\">佩戴者可以通过佩戴这枚戒指来促成一段美好的爱情。</span><span></span> \r\n</p>\r\n<span style=\"color:#333333;font-size:12px;font-family:\'Microsoft YaHei\';\"> \r\n<div style=\"text-align:center;\">\r\n	<span style=\"font-size:12px;line-height:1.5;\"></span> \r\n</div>\r\n</span> \r\n<p>\r\n	<br />\r\n</p>', '1', '', '北京', '18k铂金  玫瑰金', '10号-15号', '', '暂无明细', '2');
