INSERT INTO `hs_model` VALUES ('503', '73', '致木棉 项链', null, '380.00', null, '79', '123', '123', '0', '262', null, null, '0', '2016-04-06 18:29:11', '2', 'bAOtaOdk20160413192032.jpg;g1DIFqJh20160413192032.jpg;hACOMUOK20160413192032.jpg;6z37evd520160413192032.jpg', '123', '2', null, 'Infuture 无限未来', '北京', null, null, null, null, '2', '0', '0', null, '3D打印', '<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-family:\'Microsoft YaHei\';\">据说</span><span style=\"line-height:1.5;color:#333333;font-family:\'Microsoft YaHei\';\">DN</span><span style=\"line-height:1.5;color:#333333;font-family:\'Microsoft YaHei\';\">这是三八女人节推出的一款向新时代女性致敬的首饰。</span> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-family:\'Microsoft YaHei\';\">中学时就对舒婷的《致橡树》印象颇深，诗歌通过木棉树对橡树的“告白”，</span> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-family:\'Microsoft YaHei\';\">来否定世俗的，不平等的观念，发出新时代女性的独立宣言，表达对爱情的憧憬与向往。</span> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-family:\'Microsoft YaHei\';\">用建筑参数化模仿树的自然形象，根，紧握在地下；</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">叶，相触在云里。</span> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-family:\'Microsoft YaHei\';\">十分欣赏这种自由，平等独立，风雨同舟的爱情观，谨以此物，致木棉。</span> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:1.5;color:#333333;font-family:\'Microsoft YaHei\';\"><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411183919_670.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411183919_637.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411183919_879.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411183920_299.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411183920_727.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160411/20160411183920_88.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<br />\r\n</p>', '1', '', '北京', '925银 925银镀金', '直径3cm 链长45cm', '5-7天发货', '暂无明细', '2');
