INSERT INTO `hs_model` VALUES ('507', '73', '婚戒定制款4', null, '99999.00', null, '78', '123', '123', '0', '1', null, null, '0', '2016-04-06 20:28:04', '1', 'TMPb5Tcw20160412193753.jpg;e4TsFSTe20160412193753.jpg;zIHIq1kz20160412193753.jpg', '123', '2', null, '3DCREATIA', '北京', null, null, null, null, '1', '0', '0', '2016-04-06 21:10:05', '婚戒高级定制', '<p>\r\n	<p class=\"MsoNormal\" style=\"text-align:center;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">大量镶嵌碎钻，</span><span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">并以碎钻围绕主钻的设计，</span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:center;\">\r\n		<span style=\"line-height:1.5;font-family:\'Microsoft YaHei\';color:#333333;\">不仅能使整个戒指在自然光的照射下</span><span style=\"line-height:1.5;font-family:\'Microsoft YaHei\';color:#333333;\">blingbling</span><span style=\"line-height:1.5;font-family:\'Microsoft YaHei\';color:#333333;\">，</span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:center;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">还能在视觉效果上增加主钻克拉大小。</span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:center;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">但与众不同的是，</span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:center;\">\r\n		<span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">这款戒指在戒圈的造型上做了一些曲线的设计，</span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:center;\">\r\n		<span style=\"color:#333333;font-family:\'Microsoft YaHei\';line-height:1.5;\">使整个设计看起来柔和细腻。</span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:center;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">定制信息可根据个人喜好进行修改设计，</span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:center;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\">如有需要请联系美匠网客服专线，我们将会有专业的设计师团队与您联系沟通。</span><span></span> \r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:center;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';font-size:12px;color:#333333;\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412194050_629.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412194050_486.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412194050_321.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412194050_329.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412194051_830.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412194106_215.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412194106_884.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412194107_484.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412194107_17.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412194107_419.jpg\" alt=\"\" /><br />\r\n</span>\r\n	</p>\r\n	<div style=\"text-align:center;\">\r\n		<br />\r\n	</div>\r\n</p>', '1', '定制请联系美匠网客服专线，我们将会有专业设计师团队与您沟通。', '广东', '18k白金，钻石', '定制', '定制产品根据实际客户要求报价', '定制', '1');
