INSERT INTO `hs_model` VALUES ('512', '73', '折扇', null, '358.00', null, '81', '123', '123', '0', '1', null, null, '0', '2016-04-08 11:52:40', '1', 'lbQreKTJ20160412192129.jpg;Nx2E3m4E20160412192129.jpg;duFortuc20160412192129.jpg', '123', '2', null, '3DCREATIA', '北京', null, null, null, null, '5', '0', '0', null, '珍珠装饰耳环', '<p>\r\n	<p class=\"MsoNormal\" style=\"text-align:center;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">长条形的设计可以将整个脸型拉的修长，</span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:center;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">在耳坠尾部加宽的曲线又可以修饰部分脸部缺陷。</span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:center;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">没有复杂的装饰，日常佩戴不会显得过于夸张，</span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:center;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\">但优雅大气的线条也是聚会搭配佳品。</span><span></span> \r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:center;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';color:#333333;font-size:12px;\"><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412192313_672.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412192313_946.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160412/20160412192314_522.jpg\" alt=\"\" /><br />\r\n</span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:center;\">\r\n		<span style=\"font-family:\'Microsoft YaHei\';color:#333333;\"><br />\r\n</span>\r\n	</p>\r\n</p>', '1', '本商品由美匠发出，承诺1-2个工作日之内发出。', '广东', '925银镀金，天然淡水珍珠，施华洛世奇水晶', '暂无明细', '', '7g', '1');
INSERT INTO `hs_model` VALUES ('513', '184', '小香蕉项链', null, '499.00', null, '79', '123', '123', '0', '5708', null, null, '1', '2016-04-15 11:24:25', '2', 'ubfRbPu120160415113140.jpg;2XHRk2Ju20160415113140.jpg;BGgBOXXL20160415113140.jpg', '123', '2', null, 'JOY STONE', '北京', null, null, null, null, '5', '0', '0', null, '趣味性 甜蜜 俏皮', '<p style=\"text-align:center;\">\r\n	香蕉的设计，是用建筑上经常用的参数建模的方式进行的设计，\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	这种设计的好处是线条自然流畅，\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	香蕉的外形是一个已经剥开的香蕉，颜色对比明显，造型可爱，\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	外面的香蕉皮用的是拉丝工艺，更显质感。\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img src=\"/upload/uploadImg/modeldetail/image/20160415/20160415112245_975.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160415/20160415112245_949.jpg\" alt=\"\" /><img src=\"/upload/uploadImg/modeldetail/image/20160415/20160415112246_711.jpg\" alt=\"\" /> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<br />\r\n</p>', '1', '', '北京', '925银 镀金', '均码', '佩戴请避免化学物品，避免撞击，避免游泳及洗澡时佩戴，避免大量', '无', '2');
