INSERT INTO `hs_user` VALUES ('5267', 'Megan Xu', '', '', null, '徐梦', 'CcY2p79u20160406144754.jpeg', '3', null, '2', null, null, null, null, null, '2016-04-06 11:37:41', '4', '有思想的艺术珠宝', null, '3', '1', '让珠宝直接表达拥有者的思想。不仅是 ‘富足者’，更是’思想者’。\r\n Megan Xu将珠宝与艺术品融合统一，每一件作品既是拥有者的地位和档次的外在表达，又是品味和人格的内在体现。\r\n作品以翡翠钻石等宝玉石和贵金属为载体阐释万物，是高品质的艺术品和富内涵的奢侈品。', null, null, null, '', '', null, null, '2', 'Megan Xu', 'Megan Xu', null, '北京', null, '0', '0', '0');
