INSERT INTO `hs_user` VALUES ('3668', 'yeah jewelry', '621085832@qq.com', '', 'e2230b85c13f9330cf9531d3bd8aff84f9a3fa73', '周烨', 'P1N8sWpC20160331124104.jpeg', '2', '', '5', '北京市', null, null, null, '0', '2015-09-09 11:06:22', '4', '趣味性、手工、轻松、愉悦', null, '3', '1', 'Yeah jewelry致力于设计并创造出令人轻松愉快的首饰。热衷于对生物体及人类情感的发掘与探索。着重强调产品的原创性，趣味性。并坚持以手工制作为原则，以确保每件首饰的细节质量与独特性。在首饰设计的过程中，以赋予其更深层次的感情意义为基础，努力发掘并探索首饰与佩戴者之间的更多的可能。', null, null, null, '', '', null, null, '2', '周烨', 'Yeah jewelry', null, '北京', null, null, null, null);
