INSERT INTO `hs_user_designer_apply` VALUES ('21', '徐梦', null, '', null, null, '让珠宝直接表达拥有者的思想。不仅是 ‘富足者’，更是’思想者’。\r\n Megan Xu将珠宝与艺术品融合统一，每一件作品既是拥有者的地位和档次的外在表达，又是品味和人格的内在体现。\r\n作品以翡翠钻石等宝玉石和贵金属为载体阐释万物，是高品质的艺术品和富内涵的奢侈品。', '5267', '', '7QbXHzXC20160406113322.jpeg', '3', null, null, 'Megan Xu', 'Megan Xu', '有思想的艺术珠宝', '北京', '2016-04-06 11:37:41');
INSERT INTO `hs_user_designer_apply` VALUES ('22', '刘星宇', null, '', null, null, '刘周珠宝 创立于2012年，是专注于职场女性订制珠宝的设计师品牌，产品以钻石 彩色宝石 海水珍珠为主。刘周珠宝现已合作设计师十余位，设计风格各异，可以满足不同职场女性的需求。', '5269', '刘星宇', 'WCG1qRrL20160406174643.jpeg', '3', null, null, '刘星宇', '刘周珠宝', '职场女性 订制 钻石 彩色宝石 海水珍珠', '北京', '2016-04-06 17:47:45');
