INSERT INTO `hs_user_designer_apply` VALUES ('24', '刘洋', null, '', null, null, '玺悦珠宝于 2015 年秋季推出副线品牌 Joystone, 将玺悦珠宝的精湛设计与轻奢珠宝风格完美融合。此品牌集合多位年轻优秀的独立设计师，甄选材质优良的 925 银镀金。Joystone 将推出更丰富多样的主题作品，风格简洁明朗，更倾向于表达年轻人温馨甜蜜充满趣味性的生活观。每一款珠宝的设计都极具现代感，体现年轻消费者张扬独特的个性', '5708', 'JOY STONE', 's3wnW1ya20160415105320.jpeg', '3', null, null, '刘洋', 'JOY STONE', '温馨甜蜜、趣味性、俏皮、个性', '北京', '2016-04-15 10:54:42');
